INSERT INTO `ga_beneficios` (`id`, `titulo`, `descripcion`, `fotoLogo`) VALUES
(6, 'Promo "Gambeta Femenina"', 'Con la compra de un juego de camisetas personalizadas hasta el 31 de Diciembre de 2012, &quot;CamisetadeFutbol.com&quot; te regala 1 bolso para tu equipo + 1 cinta de capitana personalizada + un par de medias por jugadora!!\r\n<div><br />\r\nWeb: www.camisetadefutbol.com\r\n<div>Mail: info@camisetadefutbol.com</div>\r\n<div>Tel: (011)4343-0303 / (011)4342-6174</div>\r\n</div>\r\n<div><br />\r\n</div>\r\n<div><br />\r\n</div>', 'ben_6_Logo Camiseta de Futbol.jpg'),
(8, 'Obsequio Gambeta', 'Con tu compra superior a las $200 en ropa deportiva, corseter&iacute;a o trajes de ba&ntilde;o te llevas de regalo un corpi&ntilde;o deportivo de &quot;Lencer&iacute;a a domicilio&quot;! No te lo pierdas!\r\n<div><br />\r\n</div>\r\n<div>Face: Lenceria A Domicilio</div>\r\n<div>Mail: lenceria_adomicilio@hotmail.com</div>\r\n<div><br />\r\n</div>\r\n<div><br />\r\n</div>\r\n<div><br />\r\n</div>', 'ben_8_Logo Lencería.jpg'),
(9, 'Descuento en "Fitnesas" - Materiales Deportivos', 'Fitnesas, empresa especializada en todo tipo de equipamiento y materiales deportivos brinda a todas las jugadoras y DTs que juegan en Gambeta un 10% de descuento en la compra de cualquiera de sus productos! &nbsp;\r\n<div><br />\r\n</div>\r\n<div>Web: www.fitnesas.com.ar</div>\r\n<div>Mail: info@fitnesas.com.ar</div>\r\n<div><br />\r\n</div>\r\n<div><br />\r\n</div>', 'ben_9_Logo Fitnesas.png');
