INSERT INTO `ga_noticias` (`id`, `titulo`, `desarrollo`, `fecha`, `posicion`, `idTorneoCat`) VALUES
(65, 'Torneo Clausura 2013', 'Después de las vacaciones y el verano se viene el Fútbol! A partir de Marzo arranca el Torneo Clausura 2013 con más ediciones, más modalidades de juego, nuevos premios y más sorpresas para todos los equipos!<br><br>\r\nA prepararse para iniciar el año a puro Fútbol! Ahora podés jugar Fútbol 5 o Fútbol 7 y elegir entre sábado, domingo y lunes por la noche! Más partidos, más categorías y más Torneos para armar el equipo!<br><br>\r\n\r\nLa carrera al título empieza desde Marzo 2013! A no perdérsela!<br><br>\r\n\r\nInformes e inscripción en info@gambetafemenina.com.ar <br><br>', '2013-04-12', 1, 0),
(66, 'Escuela de Fútbol a lo Femenino', 'Somos la organización precursora para hacer del fútbol femenino amateur una actividad para compartir entre amigas rompiendo el paradigma de que el fútbol es solo para hombres.<br><br>\r\n\r\nEn nuestra escuela, priorizamos la enseñanza del deporte, adaptado para mujeres, sin descuidar el proceso de socialización y aprendizaje de la conciencia de equipo.<br><br>\r\n\r\nFUTBOL A LO FEMENINO, un concepto nuevo: La primera y única escuela de fútbol sin perder la feminidad. Con la técnica y experiencia de entrenadores profesionales y la feminidad propia de toda mujer.<br><br>\r\n\r\nANIMATE Y VENI A DIVERTIRTE APRENDIENDO UN DEPORTE EN EQUIPO, y sin límites de edad!<br><br>\r\n\r\nViniendo a través de Gambeta Femenina te obsequiamos una semana de entrenamiento en forma totalmente gratuita!!<br><br>\r\n\r\nContacto:<br><br>\r\n\r\nPaula Fernandes Delgado<br><br>\r\n\r\ninfo@futbolalofemenino.com.ar /www.futbolalofemenino.com.ar /\r\n\r\nwww.facebook.com/FutbolaloFemenino <br><br>', '2013-04-09', 0, 0),
(67, 'Escuelita de Futbol Femenino en la UBA Libre y gratuita!', 'Para chicas de 7 a 12 años los dias Martes y Jueves 17:30 a 18:30 hs. Sabados a confirmar hora.<br><br>\r\nY chicas de 13 a 17 años los dias Martes y Jueves de 18 a 19:30 hs.. Sabados a confirmar hora.<br><br>\r\n\r\nSumate  a ser parte del equipo de la UBA, Te esperamos!<br><br>\r\nLugar: Ciudad universitaria, cancha 5<br>br>', '2013-04-09', 0, 0),
(96, 'Resumen 10ma Fecha Clausura 2013', 'Categoría A<br><br>\r\nDPD le ganó por 8 a 3 a Bieen Nena Bieen, con goles de Jesica Borda (1), Gimena Lojo (1), Belén Ola (2), Lucila Gavilan (2) y Sofía Peluffo (2). Mientras que Ayelén Cocconi (3) marcó para el equipo vencido. <br><br>\r\nLa Naranja Mecánica consiguió un nuevo triunfo gracias al poderío ofensivo de la goleadora de la Categoría A, Sol Ulla (6), que junto a Cecilia Garbarino (2) vencieron a UBA D por 8 a 5. Por otra parte, Sofía Leanes (3) y Sofía Castilgioni (2) anotaron para achicar la diferencia en el marcador. <br><br>\r\nSin la necesidad de pisar el verde césped, UBA D le ganó por 5 a 0 a República de Charly, ya que este no se presentó a disputar el partido. <br><br>\r\nLas Pumitas empataron 2 a 2 contra Moulin por la 10ma fecha del torneo pacífico, categoría A. Marisa Amante (2) marcó para Pumitas mientras que Lucila Ruibal Gowland (1) y Alejandra Barsamian (1) anotaron para empatar el marcador. <br><br>\r\nCon goles de Ma. Victoria Velez (4), Trinidad Quintas Insua (4), Cinthia Daniela Merlo (1), Sofía Carla García (1) y Ma. Victoria Leiva (2) Fénix volvió a ganar y sigue puntero con 21 puntos. En esta oportunidad venció por 12 a 1 a L.T.A., para el cual Andrea Kofman (1) marcó el único descuento.<br><br>\r\n', '2013-06-11', 0, 66),
(97, 'Resumen 10ma Fecha Clausura 2013', 'Categoría B Azul<br><br>\r\nEn un partido parejo, M.V.Q.P. y UBA H empataron 2 a 2 por la 10ma fecha del torneo Pacífico de la Categoría Azul. <br><br>\r\nPie con Bola goleó por 11 a 2 a La Hora Juez con goles de Florencia Duran (2), Mariel Rodriguez (2), Micaela Turek (6) y Soledad Zapico (1). Mientras que Lucila Bras (1) y Benet (1) pusieron los descuentos. <br><br>\r\nEn un partido de alto vuelo, Error Trosero le ganó por la mínima a Niquelinas por 8 a 7. Los goles del triunfo fueron de Namir Risso (1), Mariana Mendoza (6) y Graciela Martin (1); mientras que Giuliana Zucchi (2), Guillermina Granados (1) y Luciana Breide (4) mantuvieron el marcador cerca de su rival. <br><br>\r\nLocatinas arrasó con Pica Vos por 7 a 0 con goles de Katie Bermange (3) y Delfina Scholand (4) por la 10ma fecha del Torneo Pacífico de la Categoría B Azul. Con este resultado Locatinas es el único escolta con 19 puntos y está a 6 pts del puntero y se encuentra con un partido menos.<br><br>\r\nCategoría B Verde<br><br>\r\nA.F.F. Pura Fiaca le ganó por 9 a 1 a Nos Fuimos al Pasto, con goles de Denise Filartiga (4), Denise Antunez (4) y Florencia Giorgi (1); mientras que Pilar Fracchia (1) convirtió el único tanto para su equipo. <br><br>\r\nEn un partido ajustado pero con muchos goles, Magas logró vencer a Las 33 por 6 a 5, con goles de Angie Casanueva (5) y Martina Prosperio (1). Por otra parte, Daiana Lezcano (3) y Victoria Bembibre (2) mantuvieron el marcador ajustado. <br><br>\r\nCon goles de Piñero (2), Camila Scaramuzzino (2) y Sabina Marelli (7) The Outsiders le ganó por 11 a 4 contra Atletic Fem. Mientras que Micaela Mollo (1), Belen Khaves (1) y Belén Marticorena (2) descontaron para el equipo vencido. <br><br>\r\nPunto A cosechó su cuarta victoria contra Las Que Tupé por 4 a 2, con goles de María Niquias (1), Viviana Volkmer (1) y Attenya Buonvicino (2). Por otra parte, Agustina Tafet (2) se hizo cargo de los goles de su equipo. <br><br>\r\nPrimer Set por 6 a 1 para AFF Marulas contra Palo y a la Bolsa, los goles del triunfo fueron de Silvia Ortigoza (1) y Lucila Villaverde (5); mientras que Valentina Ricci (1) puso el descuento. <br><br>\r\nSin la necesidad de pisar el verde césped, AFF Pura Fiaca le ganó por 5 a 0 ante T-Lento 3G, ya que este no se presentó a disputar el partido.<br><br>\r\n', '2013-06-11', 0, 67),
(98, 'Resumen 10ma Fecha Clausura 2013', 'Categoría C Zona Gris<br><br>\r\nSailorball perdió por 2 a 0 contra UBA F por la 10ma fecha del torneo Pacífico de la Categoría C Gris. Los goles del triunfo fueron de Juana Davila (1) y Florencia Martino (1). Con esta victoria el equipo ganador consiguió su quinta victoria. <br><br>\r\nDiana Casas (1) y Mayra De La Cruz (1) fueron las responsables de darle la victoria a Saraza ante Fútbol Champagne por 2 a 0, por la décima fecha del Torneo Pacífico. <br><br>\r\nUBA G le ganó por 2 a 0, con goles de Lucía Saavedra (2), a Palomas. Con esta victoria el equipo dirigido por Diego Bruscagin se posiciona en el primer puesto con 19 pts acompañando a Las Chailot’s. <br><br>\r\nEn un partido parejo hasta el final, Ritmo Indecente II y Las Chailot’s empataron 3 a 3. María Laura Guiglielmoni (1) y Karina Galiano (2) marcaron para Ritmo, mientras que Cecilia Moreno (1) y Stefania Nelli (2) anotaron para empatar el tanteador. <br><br>\r\nLos goles de Ayelen Díaz (2) y Sofía Pane (1) le dieron la victoria a ALCA FC contra Pink Unicorn que sigue en lo más profundo de la tabla de posiciones. Con esta victoria ALCA se pone a 3pts del primer puesto. <br><br>\r\nCachiquengue goleó ante Tacones por 6 a 0, con goles de Sofía Olivera (4) y Ma. Eugenia Altamirano (2), por la décima fecha del Torneo Pacífico.<br><br>\r\nCategoría C Rosa<br><br>\r\nSparrows consiguió su tercera victoria y trata de despegó del fondo de la tabla, le ganó a Victoria a Cachiva por 2 a 1, con goles  de Cavándoli (1) y Constanza Castronuevo (1). El único descuento lo marcó Lara Baudo (1). <br><br>\r\nLos goles de Sol Dioguardi (1) y Mercedes Menendéz (1) no alcanzaron y K-chorras perdió contra 187 NEB por 6 a 2. Los tantos del triunfo fueron de Agustina Zumpano (3), Paula Fernandez Polledo (1) y Magdalena Cappadoro (2). <br><br>\r\nLa Resaca FC, que cuenta con la goleadora de la categoría con 45 goles que es Agustina Donato, le ganó por 14 a 4 contra Unagui, con esta victoria se posicionó a 4 unidades del primero. Natalia Martins (1), Soledad Martinez (8) y Agustina Donato (5) fueron las responsables de darle la victoria a su equipo. Mientras que Melina Bodnar (3) y Lucía Ocampo (1) mantuvieron el primer tiempo del partido parejo pero luego se les escapó el rival en el marcador. <br><br>\r\nPilar López (2), Ludmila Clemente (5) y Evelin Alvarez (3) anotaron para darle el triunfo a AFF Los Timbos por 10 a 1 contra Amchester United FC. El único descuento lo marcó Lucila Rodriguez (1). <br><br>\r\nEn un partido sumamente parejo, Ritmo Indecente y Flower Power FC empataron 5 a 5. Romina Gómez (1), Sol Milillo (2) y Florencia Arregui (2) anotaron para Ritmo mientras que M. Celeste Payeres (1), Barbara Stein (3) y Ma. Agustina Solimano (1) pusieron el empate. <br><br>\r\nEn un partido contundente, Por el chori le ganó por 4 a 0 ante Bartolas FC, con goles de Ana Clara Piechestein (1) y Carolina Villella (3). Con esta victoria se ubica a 4 puntos del primero de tabla que es Ritmo Indecente. <br><br>\r\nCon goles de Jorgelina Chiozza (1) y Yamila Sanchez Suarez (2), Pisando Fuerte le ganó por 3 a 2 a Lassinté FC. Los goles de Julia Kohnemann (1) y Ma. Celeste Geijo (1) mantuvieron el marcador abierto hasta el final. <br><br>\r\nCategoría C-1<br><br>\r\nRichard Girls no quiere alejarse de la pelea de la categoría y por eso ganó contra Salta por 5 a 3, con goles de Juliana Taddeo (2), Consuelo Fernandez Iraci (2) y Pilar Capano (1).  Por otra parte Mercedes Torresel (3) fue la única que marcó para el equipo vencido. <br><br>\r\nEn un partido con muchos goles y con el marcador abierto hasta el final, UBA L le ganó a UBA J por 7 a 6, con goles de Belén Bello (1), Gabriela Class (3) y Emiliana Robles (3). Mientras que Lucía Villalba (2), Zulma Silvero (2) y Camila Gomez Muller (2) mantuvieron el partido parejo hasta el final. Con este triunfo UBA L quedó a 2 unidades de la punta. <br><br>\r\nLucía Restivo (3), Lourdes Seoane (1) y Paloma Zaremba (2) fueron las responsables de darle la victoria a Las Comadrejas por 6 a 2; mientras que Antonella Celluci (1) y María Luz Arco (1) marcaron los descuentos. <br><br>\r\nUBA I no se escapa tampoco de la lucha de la categoría, con la victoria ante Glamour de Bailante se posicionó a 3 puntos del primero de tabla. Los goles del triunfo fueron de Jorgelina Richard (3), Ma. Fernanda Reyna (5) , Agustina Nery (3) y Agustina Milani (1). Por otra parte María Sol Murga (1) anotó el descuento para el equipo vencido. <br><br>\r\nLos goles de Ana Catalina Dankert (2) y Trinidad Soto Acebal (2) no alcanzaron y Krakotzia perdió contra Fulbitas FC por 5 a 4. Mientras que, Rosario Skuarek (1), Flavia Rieiro (3) y Lotero Latorre (1) anotaron para darle la victoria a su equipo. <br><br>\r\nPenelopes no suelta el primer puesto con 24 puntos, le ganó a Pucha Pue por 9 a 2, con goles de Cinthia Mariela Galeano (2), Ma. Mercedes Cha (1) y Tatiana Garelik (6). Por otra parte, Ana Patrón Costas (1) y Agusta Velarde (1), anotaron para achicar el marcador. <br><br>\r\nRosario Rutilo (1) e Ines Del Giudice (3) le dieron la victoria a Alfa&Omega por 4 a 1 contra Gol Power 1.4; mientras que Agustina Alvarez Martín (1) anotó para el equipo vencido.<br><br>\r\n', '2013-06-11', 0, 68),
(99, 'Resumen 10ma Fecha Clausura 2013', 'Categoría A Zona Azul<br><br>\r\nEn un partido ajustado hasta el final, Popurrí Team y Sarasa empataron 3 a 3 por la décima fecha del Torneo Gambetero. Johana Juarez (2) y Luz Aramendi (1) anotaron para Popurrí, mientras que Trinidad Quintas Insua (1), Ma. Echeverría Gómez (1) y Rosario Recio (1) pusieron el empate. <br><br>\r\nCon goles de Yamila Castellano (5), Luisina Liliana Fanti (4) y Lara Valeria Espósito (3) anotaron para darle el triunfo a Fisura FC contra Pulmotor por 12 a 5. Sofía Arana (1), Fátima Villanueva Ruiz (1) y Estefanía de Belaustegui (3) anotaron los descuentos. <br><br>\r\nJogo Bonito está en su mejor momento, ganó ante Bomberitas por 7 a 3, está primero con 27 puntos y además una de sus integrantes, Carolina Colas, es la goleadora de la categoría con 36 goles. Los tantos del triunfo fueron de Soledad López (2), Malvina Chavez (1), Carolina Colas (2) y Natalia Palavecino (2); mientras que Sofía García (1), Victoria Velez (1) y Lourdes Domíngues (1) marcaron para el equipo vencido. <br><br>\r\nSin la necesidad de pisar el verde césped, Correcaminos le ganó por 5 a 0 a Cachorras, ya que este no se presentó a disputar el partido pautado. <br><br>\r\nCon goles de Yesica Fredes (2), Alejandra Gotisa (3) y Karen Castaño (2) le dieron la victoria a 300LB por 7 a 5 ante Sarasa. Por otra parte, Trinidad Quintas Insua (2) y Ma. Echeverría Gómez (3) mantuvieron el tanteador cerca de su rival hasta el final.<br><br>\r\nCategoría A Zona Verde<br><br>\r\nLimbo ganó por 7 a 6 ante Estrada de Almagro y es el único escolta detrás de Pico Dulce con 24 puntos. Lucía Soledad Gonzalez (1) y Florencia Russo (6) le dieron la victoria a su equipo; mientras que Patricia Gallardo (2), Ivonne Gimenez (1), Andrea Soto (1), Nuria Moraut (1) y Karina Casa (1) convirtieron para mantener el resultado ajustado hasta el final. <br><br>\r\nLos goles de Belén Bastero (1), Naair Ponso (2) y Brunella Guerra (1) no alcanzaron y Río Colorado perdió por 7 a 6 contra Mary Jane. Los tantos de Gisela Gayo (3), Magali Trapasso (1) y Florencia Nair Agüero (1) anotaron para la victoria. <br><br>\r\nLimbo jugó dos partidos esta fecha y consiguió victorias en los dos encuentros, en este caso derrotó a Alta Mezcla por 4 a 2, con goles de Lucia Gonzalez (1) y Nadia Vaucher (3). Mientras que Ma. Inés Novoa (1) y Enriqueta Martel (1) pusieron los descuentos.<br><br>\r\n', '2013-06-11', 0, 59),
(100, 'Resumen 10ma Fecha Clausura 2013', 'Categoría B<br><br>\r\nUy Uy Uy ganó por 6 a 2, con goles de Lujan Calaf (1), Alejandra Busso (2) y Celeste Pereyra (3), le ganó a Nueva Unión. Los descuentos fueron de Florencia Cimalando (1) y Guillermina Gerber (1). Con esta victoria es el único escolta con 22 unidades detrás de EPM FC. <br><br>\r\nEn un partido parejo, Siamo Fouri y La Leyenda empataron 3 a 3 por la décima fecha del Torneo Gambetero. Cecilia Couto (3) marcó para la Leyenda mientras que Antonella Bertello (1), Evangelina Pintos (1) y Evelin Alvarez (1) marcaron el empate. <br><br>\r\nMelody Gueller (5) y Astrid Malamud (1) le dieron la victoria a EPM FC ante Botineras y con este triunfo sigue primero con 24 puntos.  Por otra parte, Andrea Cardozo (1), Andrea Medina (1) y Julieta Torres (2) anotaron para el equipo vencido. <br><br>\r\nDeportivo Salerni goleó ante Pie con bola por 6 a 1, con goles de Mariela Salerni (2), Ivanna Alvarez Dubelly (2) y Ma. Belén Marticorena (2), por la décima fecha del torneo Gambetero. El único descuento lo anotó Jimena Capucello (1). <br><br>\r\nEn un partido aguerrido, Río Colorado II y Las Robles empataron 4 a 4. Nahir Ponso (2), Marina Bragagnolo (1) y Luisina Valle (1) marcaron par Río II; mientras que Romina Castioni (2) y Araki Ailen (2) empataron el partido. <br><br>\r\nLos goles de Marcela Benitez (2) y Claudia Sosa (2) no alcanzaron y La Mentira perdió contra Fiebre de Gol por 5 a 4. Los goles del triunfo fueron de Rosalia Cueva (1), Patricia Liendro (1) y Antonella Ruffunelli (3). <br><br>\r\nSin la necesidad de pisar el verde césped, V.F.C. ganó por 5 a 0 a Las Pochis FF, ya que este no se presentó a disputar el partido pautado. <br><br>\r\nSin la necesidad de pisar el verde césped, Unión CyC le ganó por 5 a 0 a República del Encuentro, ya que este no se presentó a disputar el partido pautado.<br><br>\r\n', '2013-06-11', 0, 60),
(101, 'Resumen 10ma Fecha Clausura 2013', 'Categoría C Zona Gris<br><br>\r\nDrink Team FF, el único escolta de Boogie con 25 unidades, le ganó por 5 a 3 a Poneme la Multa por 5 a 3, con goles de Angie Casanueva (3), Macarena Bogado (1) y Vera Frabrykant (1). Por otra parte Lucía Nadal (1) y Ximena Allo (2) pusieron los descuentos. <br><br>\r\nBrazukas ganó por 5 a 2 ante C.A.B.C., con goles de Rena Mello (2), Denisse Ruiz (2) y Karina Ceif (1), por la décima fecha del Torneo Gambetero. Mientras que Eugenia Alvarez (1) y Silvina R. Ponti (1) marcaron los descuentos. <br><br>\r\nLos goles de Natalia Danyluk (1), Yasmin Pesci (1), Josefina Tarelli (2) y Florencia Giovio (1) fueron las responsables de darle la victoria a Sportivo C ante Carne Kosher FC. Daiana Morgenstern (1) marcó para el equipo vencido. <br><br>\r\nEn un partido ajustado, Rolo y Estela y Río Colorado III empataron 4 a 4. Pilar Gomez (1), Valentina Campanelli (2) y Federica Rosetto (1) anotaron para Río III; mientras que María Luz Franco (4) anotó el empate. <br><br>\r\nSin la necesidad de pisar el verde césped, Mueva Chiquita le ganó por 5 a 0 contra Apretá el Pomo, ya que este no se presentó a disputar el partido pautado. <br><br>\r\nEugenia Ruggero (3), Ma. Mercedes Molinari (3), Luciana Zanparutto (2), Paula Santangelo (2) y Antonella Milidoni (2) le dieron el triunfo a  Boogie por 12 a 2 ante Nenas. Con este resultado Boogie sigue primero de la categoría con 30 unidades. Por otra parte, Victoria Mascianica (2) marcó para el equipo derrotado. <br><br>\r\nSin la necesidad de pisar el verde césped, CAFI derrotó por 5 a 0 a Banda Gordo Balón, ya que este no se presentó a disputar el partido pautado.<br><br>\r\nCategoría C Zona Rosa<br><br>\r\nBrujas derrotó a Revuelto de Gramajo por 3 a 0, con goles de Mariana Silva (1), Victoria Balaguer (1) y Ailin Reler (1), por la décima fecha del torneo Gambetero. <br><br>\r\nBelen Llapur (6), María Cecilia Ruiz (3) y Natasha Brangold (5) fueron las que les dieron la victoria Quinta Amarilla por 14 a 4. Los goles de Cecilia Valles (4) achicaron la diferencia en el marcador. <br><br>\r\nEllas FC no quiere alejarse de la punta y por eso ganó por 5 a 3 contra Ferro Fem, con goles de Emilia Fernandez (1), Natalia Fernandez (1), Pilar Cosoli (2) y Sofía Benchetrit (1). Por otra parte Marina Jaju (1) y Jesica Meccia (2) descontaron para el equipo vencido. <br><br>\r\nCarmela goleó a Natalia/Natalia por 8 a 1 con goles de Gutierrez (1), Ramos (2), Bertolo (1), Torres (3) y Martina (1). El único descuento de Natalia llegó por medio de Carolina Iglesias (1). <br><br>\r\nCon goles de Guadalupe Delgado (4), Paola Jenkins (5) y Carolina Martinez (3) Branca Team derrotó por 12 a 0 a Espartanga por la décima fecha del Torneo Gambetero. <br><br>\r\nSin la necesidad de pisar el verde césped, Chantas le ganó por 5 a 0 a LUPE ya que este no se presentó a disputar el partido pautado. <br><br>\r\nNifu Evolutión es más primero que nunca, le ganó por 10 a 1, con goles de Sandra Bravo (1), Ma. Soledad Solé (4) y Barbara Fuentes (5), a The Drink Team. El único descuento lo anotó Macarena Larrosa (1).<br><br>\r\n', '2013-06-11', 0, 61),
(102, 'Resumen 5ta Fecha Copa Otoño 2013', 'Zona Azul<br><br>\r\nCon goles de Belén Chavez (1), Paula Escobar (3), Tamara San Leone (3), Lucía Gómez (1) y Paula Arce (2) fueron las responsables de darle la victoria a Tatedetuti por 10 a 1 contra La 55. El único descuento fue de Melani Lotero. <br><br>\r\nCachorras FC venció por 7 a 2, con goles de Liliana Gauto (1), Martina Bolasini (1), Cinthia Merlo (2) y Natalia Arevalo (3), ante Las Pochis FF. Mientras que Luciana Ruiz (1) y Liz Armoa (1) pusieron los descuentos. <br><br>\r\nLos goles de Ma. Victoria Blanco (3), Mercedes Perea Muñoz (1) y Ana Valasco (1) no alcanzaron y Altas Anguilas perdió contra El Farça por 7 a 5. Los goles del triunfo los marcaron Gisela Varela (5) y Atienza (2). <br><br>\r\nEn un partido parejo, Tu Vieja ganó por la mínima contra La Fave FC por 3 a 2, con goles de Majo Bardales (2) y Mercedes Cotos (1); mientras que Pilar Carro (2) marcó para mantener el marcador parejo hasta el final. <br><br>\r\nCon un gran juego ofensivo, Alta Mezcla FC le ganó por 10 a 0 a Quinto Pase con goles de Estefanía Callejas (1), Solange Gossn (2) y Florencia Drogui (7), por la quinta fecha de la Copa de Otoño.<br><br>\r\n', '2013-06-11', 0, 76),
(103, 'Resumen 5ta Fecha Copa Otoño 2013', 'Zona Verde<br><br>\r\nLas Perlas ganó y goleó a Todas contra Juan por 27 a 2 con goles de Carla Viola (12), Lucrecia Olave (8) y Ana Clara Borrego (7). Mientras que los descuentos fueron de Macarena Edreira (2). <br><br>\r\nLos goles de Alejandra Larralde (2), Antonella Fuselli (1) y Cecilia D’ Amaro (5) fueron las responsables de darle la victoria a GEBA FC ante Es lo que hay FC por 8 a 1. Stemberg (1) anotó el único tanto del equipo vencido. <br><br>\r\nEn un partido parejo, AFF Marulas y All Girls empataron 5 a 5 por la décima fecha de la Copa e Otoño Categoría Verde. Silvia Ortigoza (1) y Lucila Villaverde (4) anotaron para Marulas mientras que Romina Musumeci (3), Barbara Fuentes (1) y Lucila Recabarren (1) empataron el marcador. <br><br>\r\nToco y me voy no pudo ante Asturiano por 9 a 1, el único tanto lo anotó Lorena Taverna (1) para el equipo vencido. Los goles de la victoria fueron de Angie Casanueva (8) y Lucía Frumboli (1). <br><br>\r\nCon goles de Lorena Martin (1), Rocío Fierro (4), Florencia Muñoz (2) y Carolina Mastrocola (4)UTN consiguió la victoria ante Las Tricolor por 11 a 1. El único descuento lo marcó Ma. Angela Romero Umbacia (1). <br><br>\r\n', '2013-06-11', 0, 77);
