eat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;2.&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Programaci&amp;oacute;n de Partidos&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Todos los equipos tendr&amp;aacute;n la posibilidad de &lt;/span&gt;&lt;span style=\\&quot;font-size:13.5pt;font-family:\r\n&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;;color:#FF3399;\r\nmso-fareast-language:ES-AR\\&quot;&gt;pedir hasta el d&amp;iacute;a Lunes&lt;/span&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt; de cada semana la programaci&amp;oacute;n del partido de la pr&amp;oacute;xima fecha dentro de un rango horario no menor a las 4 o 5 horas. La Organizaci&amp;oacute;n, por su parte, har&amp;aacute; todo lo posible para atender a dicha solicitud, pero no podr&amp;aacute; garantizarla en todas las fechas, &lt;/span&gt;&lt;span style=\\&quot;font-size:13.5pt;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;\r\nmso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;;color:#FF3399;mso-fareast-language:\r\nES-AR\\&quot;&gt;ya que todos los equipos tienen el mismo derecho de pedido de horarios y en algunas ocasiones, no es f&amp;aacute;cil garantizar dicho pedido.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Una vez finalizado el d&amp;iacute;a lunes ya no se aceptar&amp;aacute;n solicitudes de programaci&amp;oacute;n de partidos.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;El d&amp;iacute;a martes de cada semana, a partir de las 12 p.m., las capitanas de los equipos recibir&amp;aacute;n un mail de la Organizaci&amp;oacute;n comunic&amp;aacute;ndoles el horario en que se disputar&amp;aacute; su partido de la pr&amp;oacute;xima fecha y su rival. A su vez, el mismo d&amp;iacute;a se actualizar&amp;aacute; la fecha en la P&amp;aacute;gina Web (&lt;/span&gt;&lt;a href=\\&quot;http://www.gambetafemenina.com.ar/%22/%22/%22http:/www.gambetafemenina.com.ar/%22/%22/%22\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;www.gambetafemenina.com.ar&lt;/span&gt;&lt;/a&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;).&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Todas las capitanas tendr&amp;aacute;n como plazo el d&amp;iacute;a mi&amp;eacute;rcoles a las 20 hs para confirmar su asistencia al partido.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Aquellas que no hayan confirmado la asistencia de su equipo al partido hasta el mi&amp;eacute;rcoles a las 20 hs, ser&amp;aacute;n contactadas por la Organizaci&amp;oacute;n a fin de que puedan hacerlo. Se dar&amp;aacute; nuevo plazo hasta el d&amp;iacute;a jueves a las 13 hs. Si pasado el mismo, la Organizaci&amp;oacute;n no obtiene respuesta alguna, se le forzar&amp;aacute; a la fecha libre, inform&amp;aacute;ndole a la capitana por mail dicha resoluci&amp;oacute;n. Luego, la Organizaci&amp;oacute;n podr&amp;aacute; disponer de ese horario para programar otro partido. En caso que el equipo ya haya utilizado su fecha libre, entonces directamente se le quitar&amp;aacute;n los puntos del partido, d&amp;aacute;ndoselo ganado al equipo rival por un marcado de 5 a 0. En este caso, los goles no se computar&amp;aacute;n para ninguna de sus jugadoras.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;En caso que la capitana haya confirmado la asistencia de su equipo al partido y luego informe que no se presentar&amp;aacute; a jugar, en cualquier caso y autom&amp;aacute;ticamente, perder&amp;aacute; los puntos del partido, d&amp;aacute;ndoselo ganado al equipo rival por un marcador de 5 a 0. Aqu&amp;iacute; los goles no se computar&amp;aacute;n para ninguna de sus jugadoras.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;En esta situaci&amp;oacute;n pueden surgir varios casos posibles en cuanto a avisos de cancelaci&amp;oacute;n del partido:&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Equipos que jueguen los d&amp;iacute;as Domingos&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;a)&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Si el aviso se dio hasta el d&amp;iacute;a viernes a las 18 hs, el equipo perder&amp;aacute; los puntos pero no deber&amp;aacute; abonar el partido.&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;b) Si el aviso se dio luego del viernes 18 hs y hasta&amp;nbsp;el s&amp;aacute;bado hasta las 18 hs, el equipo perder&amp;aacute; los puntos y deber&amp;aacute; abonar el valor del partido.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;c) Si el aviso se dio el s&amp;aacute;bado despu&amp;eacute;s de las 18 hs o el mismo domingo, el equipo perder&amp;aacute; los puntos y deber&amp;aacute; abonar 2 (dos) veces el valor del partido.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Equipos que juegan los d&amp;iacute;as S&amp;aacute;bados&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Si el aviso se dio hasta el d&amp;iacute;a Jueves a las 18 hs, el equipo perder&amp;aacute; los puntos pero no deber&amp;aacute; abonar el partido.&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;b) Si el aviso se dio luego del jueves 18 hs y hasta&amp;nbsp;el viernes hasta las 18 hs, el equipo perder&amp;aacute; los puntos y deber&amp;aacute; abonar el valor del partido.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;br /&gt;\r\n&amp;nbsp;c) Si el aviso se dio el viernes despu&amp;eacute;s de las 18 hs o el mismo Sabado, el equipo perder&amp;aacute; los puntos y deber&amp;aacute; abonar 2 (dos) veces el valor del partido.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Todos los equipos tendr&amp;aacute;n la posibilidad de solicitar 1 (una) fecha libre durante la Fase Regular del torneo. Para ello, deber&amp;aacute;n informarlo v&amp;iacute;a mail durante el domingo y lunes de cada semana. Una vez que se ha informado y publicado el horario el d&amp;iacute;a martes, no se podr&amp;aacute; pedir reprogramaci&amp;oacute;n del horario del partido de esa fecha. En caso que el equipo no pueda asistir al encuentro, se forzar&amp;aacute; a la fecha libre, en caso que a&amp;uacute;n no haya sido utilizada. De ser as&amp;iacute;, el equipo perder&amp;aacute; los puntos de ese partido, d&amp;aacute;ndoselo ganado al rival por un marcador de 5 a 0. En este caso los goles no se computar&amp;aacute;n para ninguna de sus jugadoras.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Durante los partidos de Play-off, la Organizaci&amp;oacute;n no podr&amp;aacute; garantizar el total cumplimiento de las solicitudes de horario. Por otro lado, los equipos no podr&amp;aacute;n disponer de fecha libre en dichas instancias.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif; background-color: red; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;IMPORTANTE:&lt;/span&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt; &lt;/span&gt;&lt;span style=\\&quot;font-size:13.5pt;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;\r\nmso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;;color:#FF3399;mso-fareast-language:\r\nES-AR\\&quot;&gt;Referido a los fines de semana largos, la organizaci&amp;oacute;n avisara con tiempo suficiente a los equipos si se programaran partidos o no para esa fecha. De programarse partidos, cada equipo tendr&amp;aacute; derecho a pedir una &amp;ldquo;fecha libre extra&amp;rdquo; con el objetivo de no perjudicarlos si es que no pueden completar el numero de jugadoras correspondiente.&lt;/span&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;3. Retiro del torneo&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;La Organizaci&amp;oacute;n podr&amp;aacute; decidir el retiro o expulsi&amp;oacute;n de un equipo de una categor&amp;iacute;a o del Torneo directamente.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;En los casos en que un equipo no contin&amp;uacute;e jugando en la categor&amp;iacute;a, aquellos equipos contra los que no haya jugado tendr&amp;aacute;n el partido ganado por 5 a 0 y los goles no se computaran a ninguna de sus jugadoras. En caso de que dicho equipo haya clasificado a los&amp;nbsp;play&amp;nbsp;off, este ser&amp;aacute; reemplazado por el inmediato siguiente en cantidad de puntos, y as&amp;iacute; sucesivamente hasta ocupar los lugares designados para la clasificaci&amp;oacute;n.&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size:13.5pt;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;mso-fareast-font-family:\r\n&amp;quot;Times New Roman&amp;quot;;color:#FF3399;mso-fareast-language:ES-AR\\&quot;&gt;Es importante aclarar que en el caso de que una vez comenzado el torneo, si un equipo tiene que ser modificado de categor&amp;iacute;a por un error de la organizaci&amp;oacute;n en la nivelaci&amp;oacute;n, el o los partidos que haya disputado se borraran de las estad&amp;iacute;sticas generales del torneo en la categor&amp;iacute;a a la que ya no pertenezca.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;3.&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Play-off: (instancias Eliminatorias)&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;Una vez finalizada la fase regular del torneo, los equipos que hayan clasificado para jugar las instancias eliminatorias, no podr&amp;aacute;n agregar jugadoras nuevas en la planilla de juego.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size:13.5pt;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;mso-fareast-font-family:\r\n&amp;quot;Times New Roman&amp;quot;;color:#FF3399;mso-fareast-language:ES-AR\\&quot;&gt;En el caso de que el equipo no cumpla con esta regla, la Organizaci&amp;oacute;n podr&amp;aacute; determinar la quita de puntos y la suspensi&amp;oacute;n de dicho partido.&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Instancia de Cuartos de Final:&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;Si un encuentro llegara a su finalizaci&amp;oacute;n en un empate entre ambos equipos, el mismo se definir&amp;aacute; por&amp;nbsp;&lt;/span&gt;&lt;em&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Ventaja Deportiva.&amp;nbsp;&lt;/span&gt;&lt;/em&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Esto significa que pasar&amp;aacute; a la ronda de Semifinales el equipo que en Fase Regular haya salido victorioso.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;o&amp;nbsp;&amp;nbsp;&amp;nbsp;Ej.: &amp;ldquo;A&amp;rdquo; juega vs &amp;ldquo;B&amp;rdquo; durante la fase regular del torneo. Dicho encuentro es ganado por &amp;ldquo;A&amp;rdquo;. Si en las instancias de cuartos de final juegan &amp;ldquo;A&amp;rdquo; vs &amp;ldquo;B&amp;rdquo; y el partido termina en empate, &amp;ldquo;A&amp;rdquo; pasar&amp;aacute; a Semifinales por&amp;nbsp;&lt;/span&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Ventaja Deportiva.&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Instancia de Semifinales, Finales y 3&amp;deg; y 4&amp;deg; Puesto:&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;Si un encuentro llegara a la definici&amp;oacute;n por tiros desde el punto del penal, cada equipo debe informarle a la organizaci&amp;oacute;n el orden de las jugadoras que los ejecutar&amp;aacute;n.&lt;br /&gt;\r\n&lt;br /&gt;\r\nSe ejecutaran 3 (tres) penales por cada equipo, en caso de seguir empatados, se realizaran rondas de un penal por equipo a muerte s&amp;uacute;bita.&lt;br /&gt;\r\n&lt;br /&gt;\r\nLa lista de las primeras 3 jugadoras que efectuar&amp;aacute;n los penales deber&amp;aacute; estar formada por jugadoras que hayan finalizado el encuentro jugando el mismo.&lt;br /&gt;\r\n&lt;br /&gt;\r\nSi el encuentro continua en empate, las pr&amp;oacute;ximas dos jugadoras que efect&amp;uacute;en el tiro penal deber&amp;aacute;n ser las dos restantes en cancha (Adem&amp;aacute;s de las 3 que patearon anteriormente).&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;br /&gt;\r\nLuego se&amp;nbsp;le&amp;nbsp;dar&amp;aacute; lugar a las suplentes hasta que todas las jugadoras hayan pateado.&amp;nbsp;&lt;br /&gt;\r\n&lt;br /&gt;\r\nEn caso de que todas hayan efectuado su penal y la definici&amp;oacute;n siga en empate, se podr&amp;aacute;n repetir las mimas jugadoras, no necesariamente en el mismo orden.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;br /&gt;\r\nLa arquera puede variar su posici&amp;oacute;n, no siendo siempre la misma quien ataje durante toda la serie. Es condici&amp;oacute;n que todas aqu&amp;eacute;llas que atajen hayan finalizado el partido como &amp;ldquo;titular&amp;rdquo;.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;IMPORTANTE: Esta reglamentaci&amp;oacute;n referida a las instancias de &amp;ldquo;Cuartos de Final&amp;rdquo;, &amp;ldquo;Semifinales&amp;rdquo; y &amp;ldquo;Finales&amp;rdquo; se encuentra vigente para el Torneo Pac&amp;iacute;fico y para el Torneo Gambetero. No as&amp;iacute; para los torneos que se realizan paralelamente a los anteriormente nombrados. (Por Ejemplo: &amp;ldquo;Copa Primavera&amp;rdquo;, &amp;ldquo;Torneo Camisetadefutbol.com&amp;rdquo;, etc. Para los cuales se les dar&amp;aacute; aviso a las capitanas acerca de la modalidad de definiciones de los mismos).&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;5. Planilla&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;De inscripci&amp;oacute;n:&lt;/span&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;en la misma, se deber&amp;aacute;n completar todos los datos requeridos pertenecientes a las jugadoras que integrar&amp;aacute;n el equipo, pudiendo inscribir a un m&amp;aacute;ximo de 12 (doce). A su vez, deber&amp;aacute;n firmar la &amp;uacute;ltima hoja reconociendo que se aceptan todos los puntos citados en dicha inscripci&amp;oacute;n. Solo se permitir&amp;aacute;n incluir nuevas jugadoras en la medida en que no se haya superado el l&amp;iacute;mite citado precedentemente o bien cuando por justificada raz&amp;oacute;n alguna de las mismas no contin&amp;uacute;e jugando.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Aquellos equipos que no abonen la inscripci&amp;oacute;n no se considerar&amp;aacute;n formalmente inscriptos, por lo que su lugar podr&amp;aacute; ser ocupado por otro que la haya abonado.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;!--[if !supportLineBreakNewLine]--&gt;&lt;br /&gt;\r\n&lt;!--[endif]--&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;De juego:&lt;/span&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;previo a un encuentro, la capitana de cada equipo deber&amp;aacute; dejar asentado en la planilla de juego las jugadoras que se van a encontrar presentes y luego firmar la planilla de juego como responsable del equipo.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;br /&gt;\r\n&lt;/span&gt;&lt;strong&gt;&lt;em&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Aclaraci&amp;oacute;n&lt;/span&gt;&lt;/em&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;: Si un equipo necesita agregar nuevas jugadoras a la planilla de juego, podr&amp;aacute; hacerlo solamente durante la fase regular y en ning&amp;uacute;n caso, se podr&amp;aacute; exceder el m&amp;aacute;ximo de 12 jugadoras.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;br /&gt;\r\nEn caso de que un equipo, una vez comenzado el torneo, tenga la posibilidad de agregar nuevas jugadoras a la planilla de juego, solo lo podr&amp;aacute; hacer si el n&amp;uacute;mero total de jugadoras no excede de 12 (doce).&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;br /&gt;\r\nEsta posibilidad, solo ser&amp;aacute; otorgada a los equipos que se encuentren jugando la fase regular del torneo, no pudiendo agregar jugadoras a la planilla de juego en instancias de eliminaci&amp;oacute;n directa.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Es necesario firmar la planilla de juego 10 minutos antes del horario programado para el inicio del partido. Se permitir&amp;aacute; comenzar el mismo siempre y cuando cada equipo cuente con un m&amp;iacute;nimo de 4 jugadoras.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Finalizado el encuentro, la capitana de cada equipo tendr&amp;aacute; a su disposici&amp;oacute;n la planilla de juego con los resultados obtenidos y los goles correspondientes a cada jugadora, ya sea para certificar dicha planilla o para efectuar un reclamo correspondiente a ese partido.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;br /&gt;\r\nEn caso de realizar alg&amp;uacute;n reclamo respecto del resultado o los goles atribuidos a sus jugadoras, la capitana deber&amp;aacute; elevarlo el mismo d&amp;iacute;a del encuentro ante la presencia del &amp;aacute;rbitro en cuesti&amp;oacute;n, de manera de aclarar el episodio y determinar los datos correctos. No se aceptar&amp;aacute;n reclamos de esa &amp;iacute;ndole luego del d&amp;iacute;a en que fue jugado el partido.&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;em&gt;&lt;u&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;IMPORTANTE&lt;/span&gt;&lt;/u&gt;&lt;/em&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;: Todas las modificaciones que se realicen que un equipo necesite realizar, deber&amp;aacute;n ser pedidas v&amp;iacute;a mail para que la organizaci&amp;oacute;n pueda asegurar dicha incorporaci&amp;oacute;n. Todas las modificaciones que no hayan sido informadas a la organizaci&amp;oacute;n con estas condiciones no ser&amp;aacute;n tomadas en cuenta.&lt;/span&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;em&gt;&lt;u&gt;&lt;span style=\\&quot;font-size:13.5pt;mso-bidi-font-size:11.0pt;font-family:&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;\r\nmso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;;color:#FF3399;mso-fareast-language:\r\nES-AR\\&quot;&gt;Ingreso de Nuevas Jugadoras una vez comenzado el Torneo&lt;/span&gt;&lt;/u&gt;&lt;/em&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size:13.5pt;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;mso-fareast-font-family:\r\n&amp;quot;Times New Roman&amp;quot;;color:#FF3399;mso-fareast-language:ES-AR\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size:13.5pt;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;mso-fareast-font-family:\r\n&amp;quot;Times New Roman&amp;quot;;color:#FF3399;mso-fareast-language:ES-AR\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size:13.5pt;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;mso-fareast-font-family:\r\n&amp;quot;Times New Roman&amp;quot;;color:#FF3399;mso-fareast-language:ES-AR\\&quot;&gt;La organizaci&amp;oacute;n, para asegurarse de que todas las categor&amp;iacute;as sean, de acuerdo a su nivel, lo mas parejas posibles, organizar&amp;aacute; antes del inicio de cada torneo, Partidos&amp;nbsp;Nivelatorios. Los mismos dejar&amp;aacute;n la pauta del nivel del equipo y de acuerdo a eso, la Organizaci&amp;oacute;n determinar&amp;aacute;, a su total criterio, la categor&amp;iacute;a correspondiente a cada equipo. Cabe aclarar que la Organizaci&amp;oacute;n no observar&amp;aacute; el nivel individual de las jugadoras, sino el colectivo y general de todo el equipo.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size:13.5pt;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;mso-fareast-font-family:\r\n&amp;quot;Times New Roman&amp;quot;;color:#FF3399;mso-fareast-language:ES-AR\\&quot;&gt;Los equipos que se encuentren en etapa de jugar Partidos Nivelatorios para definir su nivel de juego, ser&amp;aacute;n categorizados en base al nivel demostrado por las jugadoras que concurrieron a dichos encuentros. En caso de que incorporen jugadoras luego de los &amp;ldquo;Partidos Nivelatorios Obligatorios&amp;rdquo; la organizaci&amp;oacute;n podr&amp;aacute; recategorizarlas con el objetivo de no tener problemas de niveles en las diferentes categor&amp;iacute;as.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size:13.5pt;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;mso-fareast-font-family:\r\n&amp;quot;Times New Roman&amp;quot;;color:#FF3399;mso-fareast-language:ES-AR\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size:13.5pt;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;mso-fareast-font-family:\r\n&amp;quot;Times New Roman&amp;quot;;color:#FF3399;mso-fareast-language:ES-AR\\&quot;&gt;Todo equipo que quiera incorporar jugadoras una vez comenzado el torneo, deber&amp;aacute; tener en cuenta, adem&amp;aacute;s de los requisitos anteriormente nombrados, que las incorporaciones deben tener el un nivel de juego similar que el resto de sus jugadoras. De esta forma, se garantiza que el equipo continuar&amp;aacute; perteneciendo a la categor&amp;iacute;a donde fue ubicado por la Organizaci&amp;oacute;n.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size:13.5pt;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;mso-fareast-font-family:\r\n&amp;quot;Times New Roman&amp;quot;;color:#FF3399;mso-fareast-language:ES-AR\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; style=\\&quot;background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;em&gt;&lt;u&gt;&lt;span style=\\&quot;font-size:15.0pt;font-family:\r\n&amp;quot;Courier New&amp;quot;;color:#FF3399;background:black;mso-highlight:black\\&quot;&gt;INCORPORACION DE JUGADORAS:&lt;/span&gt;&lt;/u&gt;&lt;/em&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size:10.0pt;font-family:&amp;quot;Courier New&amp;quot;;\r\ncolor:#FF3399\\&quot;&gt; &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; style=\\&quot;background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size:13.5pt;font-family:\r\n&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;;color:#FF3399;\r\nmso-fareast-language:ES-AR\\&quot;&gt;Todos los equipos tienen la posibilidad de inscribir hasta un m&amp;aacute;ximo de 12 jugadoras en su Lista de Buena Fe. Por reglamento, durante la Fase Regular, en caso de necesidad, los equipos tienen permitido modificar dicha planilla incorporando o relegando jugadoras. Debido a que todos los equipos se encuentran nivelados de acuerdo a los partidos de nivelaci&amp;oacute;n previos y a la Planilla de Inscripcion que env&amp;iacute;an al inicio del Torneo, se tomar&amp;aacute;n ciertas medidas para poder controlar el ingreso o incorporaci&amp;oacute;n de nuevas jugadoras.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;/span&gt;&lt;strong&gt;&lt;em&gt;&lt;span style=\\&quot;font-size:15.0pt;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;\r\nmso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;;color:#FF3399;mso-fareast-language:\r\nES-AR\\&quot;&gt;Pasos a seguir:&lt;/span&gt;&lt;/em&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size:13.5pt;font-family:\r\n&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;;color:#FF3399;\r\nmso-fareast-language:ES-AR\\&quot;&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n1- El equipo que quiera incorporar una nueva jugadora deber&amp;aacute; dar aviso a nuestro correo electronico (&lt;/span&gt;&lt;a href=\\&quot;http://webmail.dnsprivados7.com/default/lang/es/Forms/MAI/Preview.aspx?ID=A7EE605FFD9C4A8BB4D3BF89BA68AE94.MAI&amp;amp;Folder=%5cSent+Items&amp;amp;Page=8&amp;amp;SortMode=Received%20Desc\\&quot;&gt;&lt;span style=\\&quot;font-size:13.5pt;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;mso-fareast-font-family:\r\n&amp;quot;Times New Roman&amp;quot;;color:#FF3399;mso-fareast-language:ES-AR;text-decoration:\r\nnone;text-underline:none\\&quot;&gt;info@gambetafemenina.com.ar&lt;/span&gt;&lt;/a&gt;&lt;span style=\\&quot;font-size:13.5pt;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;mso-fareast-font-family:\r\n&amp;quot;Times New Roman&amp;quot;;color:#FF3399;mso-fareast-language:ES-AR\\&quot;&gt;) para que la Organizaci&amp;oacute;n est&amp;eacute; al tanto de que una jugadora nueva ser&amp;aacute; incorporada al equipo. En el caso de que un equipo incorpore una jugadora y no de aviso a la organizaci&amp;oacute;n, perder&amp;aacute; el partido por 5 a 0 y los goles no se adjudicar&amp;aacute;n a ninguna jugadora del equipo rival.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; style=\\&quot;background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size:13.5pt;font-family:\r\n&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;;color:#FF3399;\r\nmso-fareast-language:ES-AR\\&quot;&gt;En el caso de que un equipo no haya dado aviso a la Organizaci&amp;oacute;n a trav&amp;eacute;s del correo electr&amp;oacute;nico anteriormente nombrado, podr&amp;aacute; hacerlo personalmente avis&amp;aacute;ndole al encargado de cancha antes del inicio de su partido. La diferencia transcurre en que si el aviso se da a trav&amp;eacute;s del correo electr&amp;oacute;nico la Organizaci&amp;oacute;n podr&amp;aacute; orientarlas en relaci&amp;oacute;n a si es correcta la incorporaci&amp;oacute;n o no. Haci&amp;eacute;ndolo de forma personal minutos antes de comenzar su partido, no podr&amp;aacute;n estar tan asesoradas pudiendo tener los problemas que citamos a continuaci&amp;oacute;n. &lt;br /&gt;\r\n&lt;br /&gt;\r\n2- A partir del aviso, la organizaci&amp;oacute;n dispondr&amp;aacute; de los primeros 10 minutos de juego para evaluar si la jugadora incorporada pertenece al nivel de juego colectivo del equipo y de la categor&amp;iacute;a. En el caso de que se considere que la/las jugadora/as incorporada no cumpla con este requisito, autom&amp;aacute;ticamente se lo informar&amp;aacute; a la capitana y la misma deber&amp;aacute; abandonar el Juego.&lt;br /&gt;\r\nSi en el tiempo que la Organizaci&amp;oacute;n tiene para evaluar el nivel de juego de las jugadoras incorporadas (10 minutos), las mismas han logrado sacar una diferencia num&amp;eacute;rica de mas de 2 goles, el partido volver&amp;aacute; a estar empatado 0 a 0 quedando por jugar el tiempo restante de la primera mitad y un segundo tiempo de 25 minutos.&lt;br /&gt;\r\n&lt;br /&gt;\r\nIMPORTANTE: Los par&amp;aacute;metros para determinar si una jugadora puede competir en un equipo sin afectar el nivel de juego general del mismo, queda pura y exclusivamente a criterio de la Organizaci&amp;oacute;n.&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size:13.5pt;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;mso-fareast-font-family:\r\n&amp;quot;Times New Roman&amp;quot;;color:#FF3399;mso-fareast-language:ES-AR\\&quot;&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size:13.5pt;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;mso-fareast-font-family:\r\n&amp;quot;Times New Roman&amp;quot;;color:#FF3399;mso-fareast-language:ES-AR\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size:13.5pt;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;mso-fareast-font-family:\r\n&amp;quot;Times New Roman&amp;quot;;color:#FF3399;mso-fareast-language:ES-AR\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;em&gt;&lt;u&gt;&lt;span style=\\&quot;font-size: 14pt; font-family: Arial, sans-serif;\\&quot;&gt;Pr&amp;eacute;stamos de Jugadoras:&lt;/span&gt;&lt;/u&gt;&lt;/em&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;En el caso que un equipo necesite pedir prestada a una jugadora que se encuentre jugando en el torneo debido a causa de fuerza mayor para presentarse a jugar, esta s&amp;oacute;lo podr&amp;aacute; jugar en caso de el equipo en el que figure como inscripta pertenezca a una categor&amp;iacute;a de menor nivel con respecto al equipo que la pide prestada. Si estas condiciones no est&amp;aacute;n dadas, y la jugadora prestada pertenece a la misma categor&amp;iacute;a o a una superior, se deber&amp;aacute; consultar a la capitana del equipo rival sobre la autorizaci&amp;oacute;n para que la misma pueda jugar, pudiendo aceptarla o declinarla. &lt;/span&gt;&lt;span style=\\&quot;font-size:13.5pt;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;\r\nmso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;;color:#FF3399;mso-fareast-language:\r\nES-AR\\&quot;&gt;En este caso, el quipo que no cumpla con estos requisitos puede directamente perder el encuentro por 5 a 0.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size:13.5pt;font-family:&amp;quot;&amp;quot;}&amp;quot;,&amp;quot;serif&amp;quot;;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;;\r\nmso-bidi-font-family:&amp;quot;Times New Roman&amp;quot;;color:black;mso-fareast-language:ES-AR\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;em&gt;&lt;u&gt;&lt;span style=\\&quot;font-size:13.5pt;mso-bidi-font-size:11.0pt;font-family:&amp;quot;&amp;quot;}&amp;quot;,&amp;quot;serif&amp;quot;;\r\nmso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;;mso-bidi-font-family:&amp;quot;Times New Roman&amp;quot;;\r\ncolor:black;mso-fareast-language:ES-AR\\&quot;&gt;IMPORTANTE:&lt;/span&gt;&lt;/u&gt;&lt;/em&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;Una jugadora puede pertenecer a dos equipos de diferentes categor&amp;iacute;as. Recuerden que la organizaci&amp;oacute;n evaluar&amp;aacute; el nivel general del equipo de acuerdo a la categor&amp;iacute;a. Cabe destacar como lo hemos mencionado en puntos anteriores, que las determinaciones acerca de la nivelaci&amp;oacute;n de los equipos y de las jugadoras que pertenezcan a m&amp;aacute;s de una categor&amp;iacute;a queda pura y exclusivamente a criterio de la organizaci&amp;oacute;n.&amp;nbsp;&lt;/span&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;6. Tolerancias para el inicio de los partidos&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;El tiempo de tolerancia para cada uno de los encuentros es de 15 minutos. Pasado ese tiempo, si uno de los equipos llega tarde, el que haya respetado el horario, podr&amp;aacute; reclamar el beneficio de obtener el partido como ganado sin necesidad de jugar el encuentro (este presente o no su rival). En ese caso, se le dar&amp;aacute; la victoria por 5-0 sin que los goles se atribuyan a ninguna de sus jugadoras.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Dado el caso de que un equipo llegue tarde al encuentro y su rival pida los puntos del mismo, podr&amp;aacute; jugarse un partido amistoso. De no querer hacerlo, el equipo que haya llegado tarde deber&amp;aacute; abonar dos veces el costo del partido, ya que se considerar&amp;aacute; como una inasistencia al partido.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Este beneficio siempre se otorgar&amp;aacute; en la medida en que la cancha de juego destinada a dicho partido se encuentre desocupada y en condiciones de ser utilizada para el inicio del encuentro.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;u&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/u&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;u&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;IMPORTANTE&lt;/span&gt;&lt;/u&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Los equipos siempre ser&amp;aacute;n citados 15 minutos antes del horario de su partido con el objetivo de no demorar el inicio del encuentro.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Ejemplo: Si el partido fue programado para las 15 Hs, ambos equipos ser&amp;aacute;n citados 14:45 Hs. El &amp;ldquo;Tiempo de Tolerancia&amp;rdquo; se toma en cuenta a partir del horario de citaci&amp;oacute;n. Se respetara siempre la cancha que figure en cartelera.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;!--[if !supportLineBreakNewLine]--&gt;&lt;br /&gt;\r\n&lt;!--[endif]--&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Si el equipo decide jugar el encuentro y desea obtener el beneficio anteriormente nombrado, deber&amp;aacute; inform&amp;aacute;rselo a la organizaci&amp;oacute;n previa al inicio del enfrentamiento. En este caso, el costo del partido deber&amp;aacute; ser abonado por ambas partes, independientemente de que la victoria haya sido adjudicada a uno de los equipos.&lt;br /&gt;\r\n&lt;br /&gt;\r\nLos partidos, en el caso de jugarse con un atraso superior a los 15 minutos, se podr&amp;aacute;n acortar en su tiempo, independientemente de que los puntos se encuentren o no en juego, con el esp&amp;iacute;ritu de no demorar a los dem&amp;aacute;s partidos y equipos (se dar&amp;aacute; previo aviso a las capitanas de cada equipo en caso de tomar esta medida).&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Llegada la hora de inicio del encuentro, y teniendo la cancha a disposici&amp;oacute;n, el equipo que cuente al menos con 4 de sus jugadoras deber&amp;aacute; comenzar a disputar su partido, no permitiendo el retraso del mismo.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;7. Reclamos&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;En lo que se refiere a reclamos, se podr&amp;aacute;n realizar con un plazo de 7 d&amp;iacute;as luego de haber acontecido el partido y deber&amp;aacute; efectuarse en forma escrita; detr&amp;aacute;s de su planilla de juego. Pasado este tiempo, la organizaci&amp;oacute;n podr&amp;aacute; no hacerse responsable de los mismos.&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;En caso que correspondiere, La Organizaci&amp;oacute;n responder&amp;aacute; en forma escrita hacia la capitana del equipo, dando las debidas explicaciones del caso y responsabiliz&amp;aacute;ndose por lo ocurrido de ser necesario.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;8. Otros acontecimientos&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; style=\\&quot;background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;em&gt;&lt;span style=\\&quot;font-size: 14pt; font-family: \\''Courier New\\''; background-color: red; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;SUSPENSION POR LLUVIA:&lt;/span&gt;&lt;/em&gt;&lt;/strong&gt;&lt;strong&gt;&lt;em&gt;&lt;span style=\\&quot;font-size: 14pt; font-family: \\''Courier New\\'';\\&quot;&gt; &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/em&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size:13.5pt;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;mso-fareast-font-family:\r\n&amp;quot;Times New Roman&amp;quot;;color:#FF3399;mso-fareast-language:ES-AR\\&quot;&gt;En el caso de que la Organizaci&amp;oacute;n decida suspender partidos por lluvia, lo har&amp;aacute; llamando telef&amp;oacute;nicamente a las capitanas de los equipos afectados. Es importante destacar que si el equipo no recibe ninguna informaci&amp;oacute;n ni aviso por parte de la organizaci&amp;oacute;n, significa que los partidos se desarrollan con normalidad. Bajo ning&amp;uacute;n motivo el equipo puede dar por sentado que por mal tiempo su partido fue suspendido si no recibe, como mencionamos anteriormente, el correspondiente llamado de la Organizaci&amp;oacute;n. De todas formas, ante cualquier incertidumbre o duda, pueden comunicarse a los tel&amp;eacute;fonos de la Organizaci&amp;oacute;n, seg&amp;uacute;n corresponda el d&amp;iacute;a (lunes a viernes o fin de semana).&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;En caso de suspensi&amp;oacute;n total de la fecha, la misma se jugar&amp;aacute; el domingo inmediato siguiente.&amp;nbsp;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;br /&gt;\r\nEn caso de que un equipo haya suspendido un partido fuera de los plazos otorgados por el reglamento y la jornada tuvo que suspenderse por lluvia, el mismo igualmente perder&amp;aacute; el partido por 5 a 0 y, en caso que correspondiere, deber&amp;aacute; abonar el partido. Esto quiere decir que si un equipo suspende un partido fuera de los t&amp;eacute;rminos ya explicados, el mismo no podr&amp;aacute; reprogramarse.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;En caso que se haya jugado la fecha en forma parcial, aqu&amp;eacute;llos partidos que debieron ser suspendidos se reprogramar&amp;aacute;n en fecha conveniente para ambos equipos y dichas reprogramaciones ser&amp;aacute;n coordinadas por la organizaci&amp;oacute;n.&lt;br /&gt;\r\nLa organizaci&amp;oacute;n se reserva el derecho de modificar la programaci&amp;oacute;n de los partidos como as&amp;iacute; tambi&amp;eacute;n la estructura del torneo para la correcta marcha del mismo.&amp;nbsp;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;!--[if !supportLineBreakNewLine]--&gt;&lt;br /&gt;\r\n&lt;!--[endif]--&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;La organizaci&amp;oacute;n no se hace responsable de las posibles p&amp;eacute;rdidas materiales dentro o fuera del complejo.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;La organizaci&amp;oacute;n no se hace responsable de los posibles accidentes ocasionados dentro y fuera del campo de juego. De todos modos el establecimiento dispone de dos servicios de ambulancia, un botiqu&amp;iacute;n de primeros auxilios y un Medico matriculado a disposici&amp;oacute;n de las jugadoras.&lt;br /&gt;\r\n&lt;br /&gt;\r\nLa Organizaci&amp;oacute;n no puede desautorizar ning&amp;uacute;n tipo de fallo arbitral durante el transcurso o luego de la finalizaci&amp;oacute;n de un encuentro, ya sea de fase regular o Play-off. El &amp;aacute;rbitro es la m&amp;aacute;xima autoridad dentro de la cancha, por lo que ninguna persona desde fuera de la misma podr&amp;aacute; revertir lo que determine.&amp;nbsp;&lt;br /&gt;\r\nLa organizaci&amp;oacute;n se reserva el derecho de admisi&amp;oacute;n tanto al torneo como al complejo.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;Parte II: JUEGO&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;1. Duraci&amp;oacute;n de los partidos&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;El encuentro se divide en dos tiempos de 25 minutos, con un entretiempo de 3 minutos.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;2. Puntos&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Por partido ganado se obtendr&amp;aacute;n 3 - tres - puntos, por partido empatado 1 - uno - punto y por partido perdido 0 - cero - puntos.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;3. Estructura del torneo&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;La modalidad de juego de cada torneo quedar&amp;aacute; a criterio de La Organizaci&amp;oacute;n en funci&amp;oacute;n de la necesidad, cantidad de categor&amp;iacute;as y mejor esquema de juego para los equipos. &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Previo al inicio de cada Torneo, se dar&amp;aacute; aviso a las capitanas de cada equipo sobre como ser&amp;aacute; la estructura, modalidad y categor&amp;iacute;as.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;4. Goles&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Ser&amp;aacute;n v&amp;aacute;lidos pasando la mitad de la cancha. No est&amp;aacute;n permitidos los goles directos de los saques del medio (Debe haber un pase previo). En ambos casos ser&amp;aacute;n validos con excepci&amp;oacute;n de que la pelota se desv&amp;iacute;e en alguna jugadora o la arquera antes de entrar al arco. Si el remate se efect&amp;uacute;a sobre la l&amp;iacute;nea del medio de la cancha el gol ser&amp;aacute; v&amp;aacute;lido.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;5. Cambios&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Adem&amp;aacute;s de los 5 titulares se permite tener hasta 7 suplentes m&amp;aacute;s. Los cambios son ilimitados.&lt;/span&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;Los mismos pueden realizarse siempre que la pelota se encuentre fuera de juego y siempre que el equipo que lo solicite se encuentre con el bal&amp;oacute;n a favor.&lt;/span&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;Ejemplo: El equipo &amp;ldquo;A&amp;rdquo; tiene la necesidad de pedir un cambio, el &amp;aacute;rbitro se lo va a otorgar cuando su equipo tenga por ejemplo un lateral o un tiro libre a favor. Con excepci&amp;oacute;n de que una jugadora de cualquiera de los dos equipos tenga que ser reemplazada por alguna lesi&amp;oacute;n, en este caso el &amp;aacute;rbitro podr&amp;aacute; otorgar el cambio de dicha jugadora en cualquier momento del partido siempre y cuando el bal&amp;oacute;n se encuentre fuera de juego.&lt;/span&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;El esp&amp;iacute;ritu de esta regla es la de no interrumpir ninguna jugada ni avance de gol para ninguno de los dos equipos.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;Aclaraci&amp;oacute;n:&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Dicha reglamentaci&amp;oacute;n para poder realizar &amp;ldquo;Cambios&amp;rdquo; en el momento del partido se encuentra vigente para los torneos que se realicen los d&amp;iacute;as Domingos. En los Torneos que se llevan a cabo los d&amp;iacute;as S&amp;aacute;bados, los equipos pueden realizar los cambios pertinentes en cualquier momento del partido, siempre y cuando el &amp;Aacute;rbitro del encuentro lo autorice.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;6. Arquera&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Tanto el saque de arco como as&amp;iacute; tambi&amp;eacute;n cualquier inicio del juego por parte de la arquera, tendr&amp;aacute; que realizarse con las manos, no pudiendo la pelota ir m&amp;aacute;s all&amp;aacute; de la mitad de la cancha, excepto que sea interceptada por cualquier jugadora de campo en su trayecto y con anterioridad a que supere dicha zona. En caso que esto suceda, el equipo contrario repondr&amp;aacute; el juego con un lateral ejecutado desde la mitad de la cancha. &amp;Uacute;nicamente la arquera podr&amp;aacute; sacar con el pie en caso que deje picar la pelota dentro de su &amp;aacute;rea. Se considerar&amp;aacute; que la pelota &amp;ldquo;est&amp;aacute; en juego&amp;rdquo; una vez que la misma haya sido golpeada por la arquera con su pie y no antes, no pudiendo permitirse el ingreso al &amp;aacute;rea de una jugadora rival. En caso a la arquera, se le imposibilite el saque porque una jugadora rival se encuentra &amp;ldquo;molest&amp;aacute;ndola&amp;rdquo; dentro del &amp;aacute;rea, en primera instancia se le har&amp;aacute; una advertencia a la misma, de repetirse la acci&amp;oacute;n se la sancionar&amp;aacute; con una tarjeta amarilla. Asimismo, en caso que la arquera saque y una jugadora rival, encontr&amp;aacute;ndose dentro del &amp;aacute;rea, interceptase el bal&amp;oacute;n con el fin de impedir el juego r&amp;aacute;pido, ser&amp;aacute; sancionada directamente con una tarjeta amarilla.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;No ser&amp;aacute; v&amp;aacute;lido el gol convertido de forma directa por la arquera que saque del arco bajo esta modalidad. En tal caso, el equipo contrario repondr&amp;aacute; el juego desde el medio de la cancha mediante un lateral.&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;br /&gt;\r\nLa arquera NO PUEDE pasar la mitad de la cancha con o sin pelota dominada. Tampoco podr&amp;aacute; recibir la pelota con las manos si una jugadora de su propio equipo le hace un pase directo con el pie (est&amp;aacute; permitido el pase desde un lateral, con la cabeza o con el pecho). En caso de cometerse dicha infracci&amp;oacute;n, el rival tendr&amp;aacute; a su favor un tiro libre indirecto fuera del &amp;aacute;rea, lo m&amp;aacute;s pr&amp;oacute;ximo al lugar en donde se cometi&amp;oacute; la misma.&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;br /&gt;\r\nLa arquera no puede darse juego a s&amp;iacute; misma. En caso contrario, en primera instancia se le dara un aviso, de persistir el error, se cobrar&amp;aacute; lateral para el equipo contrario desde el lugar m&amp;aacute;s pr&amp;oacute;ximo a la infracci&amp;oacute;n.&lt;/span&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;7. Saques laterales&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Se efect&amp;uacute;an con las manos sin permitirse env&amp;iacute;os por el aire al &amp;aacute;rea rival. (La trayectoria de la pelota no puede en ning&amp;uacute;n momento atravesar la superficie del &amp;aacute;rea aunque no pique en la misma).&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Asimismo, la pelota deber&amp;aacute; tomarse por detr&amp;aacute;s de la cabeza para hacer el lanzamiento. En caso que esto no suceda, se cobrar&amp;aacute; &amp;ldquo;lanzamiento incorrecto&amp;rdquo; y se dar&amp;aacute; posesi&amp;oacute;n de la pelota al equipo oponente, quien repondr&amp;aacute; con otro lateral desde el mismo lugar. La distancia que debe guardar el adversario son 3(tres) pasos (la distancia ser&amp;aacute; cedida siempre y cuando la jugadora lo pida).&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;8. Tiros libres&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Ser&amp;aacute;n directos e indirectos (a criterio del &amp;aacute;rbitro en funci&amp;oacute;n del tipo de infracci&amp;oacute;n y su gravedad). En todos los casos, indicar&amp;aacute; tanto a la arquera como a la ejecutante qu&amp;eacute; clase de tiro libre ha sancionado. 5 (cinco pasos) ser&amp;aacute; la distancia de la barrera, la que ser&amp;aacute; cedida siempre y cuando la jugadora ejecutante lo solicite. &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;em&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;IMPORTANTE:&lt;/span&gt;&lt;/em&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;En caso de que el equipo que tiene un tiro libre a favor no pida &amp;ldquo;distancia&amp;rdquo; hacia la barrera formada por el equipo rival, el mismo podr&amp;aacute; jugar r&amp;aacute;pido sin esperar la autorizaci&amp;oacute;n del &amp;aacute;rbitro.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Cabe aclarar que en un caso donde se cobre tiro libre para cualquiera de los dos equipos, si en ese momento hay alguna jugadora lastimada el juego se detendr&amp;aacute; y a partir de ese momento si se deber&amp;aacute; esperar la autorizaci&amp;oacute;n del arbitro para seguir con el juego.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;9. Disputa en el piso&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Se considera falta indirecta tirarse a los pies del rival para recuperar el bal&amp;oacute;n o bien disputar el mismo. En ese caso, se sancionar&amp;aacute; tiro libre indirecto para el equipo oponente. No se considera infracci&amp;oacute;n en el piso cuando no hay rival que est&amp;eacute; disputando conjuntamente la pelota. La arquera, dentro de su propia &amp;aacute;rea, podr&amp;aacute; ir al piso siempre. Esto no implica que no pueda cometer infracci&amp;oacute;n a la jugadora rival, la que si ser&amp;aacute; cobrada por el &amp;aacute;rbitro. Si una jugadora va al piso dentro de su propia &amp;aacute;rea se cobrar&amp;aacute; tiro libre indirecto fuera de la misma, en el lugar m&amp;aacute;s pr&amp;oacute;ximo a la infracci&amp;oacute;n. La sanci&amp;oacute;n de este tipo de faltas, queda exclusivamente a criterio del &amp;aacute;rbitro.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;10. Mano&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;El &amp;aacute;rbitro sancionar&amp;aacute; la mano de acuerdo a la intenci&amp;oacute;n de la jugadora de usar la misma. Sin embargo, en caso que no sea intencional pero corte una acci&amp;oacute;n clara de avance para el equipo rival, tambi&amp;eacute;n podr&amp;aacute; ser sancionada. La aplicaci&amp;oacute;n de esta sanci&amp;oacute;n como la de sacar una tarjeta quedar&amp;aacute; a entero criterio del &amp;aacute;rbitro.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size:13.5pt;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;mso-fareast-font-family:\r\n&amp;quot;Times New Roman&amp;quot;;color:#FF3399;mso-fareast-language:ES-AR\\&quot;&gt;Al tratarse de un Torneo de Futbol Femenino, las jugadoras est&amp;aacute;n autorizadas a curbirse los pechos siempre y cuando los brazos y las manos est&amp;eacute;n pegadas al cuerpo.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;11. Tiros de esquina&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;El gol directo es v&amp;aacute;lido. Se permiten env&amp;iacute;os al &amp;aacute;rea. La distancia reglamentaria al punto de ejecuci&amp;oacute;n ser&amp;aacute; de 3 (tres) pasos, siempre y cuando la ejecutante as&amp;iacute; lo solicite. Necesariamente la pelota debe estar apoyada sobre la l&amp;iacute;nea de fondo de la cancha.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;12. Tiros penales&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Se ejecutar&amp;aacute;n sin carrera, a pie firme, teniendo el pie de apoyo al lado del bal&amp;oacute;n. En caso que exista alg&amp;uacute;n tipo de rebote luego de la ejecuci&amp;oacute;n, el juego continuar&amp;aacute;. Todas las jugadoras deber&amp;aacute;n permanecer por detr&amp;aacute;s de la l&amp;iacute;nea de la pelota hasta que el penal se realice. Si as&amp;iacute; no ocurriere, el &amp;aacute;rbitro deber&amp;aacute; hacer ejecutar nuevamente el penal. La arquera deber&amp;aacute; permanecer con sus pies en la l&amp;iacute;nea de gol. Si se adelantara, tratando de obtener ventaja de su posici&amp;oacute;n para tapar el bal&amp;oacute;n, el &amp;aacute;rbitro deber&amp;aacute; hacer ejecutar nuevamente el penal.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;13. Corte del partido&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;En los casos en que el &amp;aacute;rbitro lo considere necesario, podr&amp;aacute; cortar el desarrollo del partido, pudiendo ser algunas de las causas, tiempo para refresco de jugadoras en caso de excesivo calor, lesi&amp;oacute;n de una jugadora a pesar que el juego contin&amp;uacute;e, etc. Esta medida queda determinada a entero criterio del &amp;aacute;rbitro.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;14. Suspensi&amp;oacute;n del partido&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;El &amp;aacute;rbitro podr&amp;aacute; suspender un partido en cualquier momento del mismo en caso que entienda que no existen garant&amp;iacute;as para el normal desarrollo del mismo. A su vez, deber&amp;aacute; informar las causas a las Capitanas de cada equipo como a La Organizaci&amp;oacute;n, quien determinar&amp;aacute; la designaci&amp;oacute;n de puntos y la reprogramaci&amp;oacute;n o no del partido.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;15. Comportamiento de los DT&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Todos los equipos tienen permitida la presencia de un/a Director/a T&amp;eacute;cnica que ayude y d&amp;eacute; indicaciones t&amp;aacute;cticas a sus jugadoras. Estos deber&amp;aacute;n encontrarse fuera del per&amp;iacute;metro de la cancha y presentar buen comportamiento deportivo, animando al equipo en la competencia sana y leal. En caso que el &amp;aacute;rbitro y/o los veedores consideren y/o juzguen que su conducta o actitudes engendran violencia, competencia desleal, insultos a las autoridades o a las integrantes del otro equipo o incentivan a un juego excesivamente brusco en sus jugadoras, podr&amp;aacute; expulsarlo del partido, debiendo abandonar la cancha, y no tendr&amp;aacute; acceso a hablar con sus dirigidas hasta la finalizaci&amp;oacute;n del encuentro o bien en el entretiempo tanto en ese partido como en el inmediato siguiente.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;En el caso de que un/a DT sea expulsado/a por un mal comportamiento y el mismo no quiera abandonar el campo de juego, el partido no reanudar&amp;aacute;. Dado el caso de que por este motivo el partido no pueda continuar, el mismo se suspender&amp;aacute; d&amp;aacute;ndole como ganado el encuentro al equipo oponente.&lt;/span&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;De acuerdo a esta situaci&amp;oacute;n el encuentro podr&amp;aacute; resolverse de 2 formas:&lt;/span&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;a)&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Si el equipo del DT expulsado y que no quiere abandonar la cancha por el momento iba ganando o empatando. El mismo, luego de definirse la suspensi&amp;oacute;n del partido, terminar&amp;aacute; perdiendo dicho encuentro por 5 a 0 en favor del otro equipo, no otorg&amp;aacute;ndose los goles a ninguna de sus jugadoras.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;b)&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Si el equipo del DT expulsado y que no quiere abandonar la cancha por el momento iba perdiendo, el resultado de esa instancia del partido ser&amp;aacute; el resultado final del encuentro.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;em&gt;&lt;u&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/u&gt;&lt;/em&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;em&gt;&lt;u&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Aclaraci&amp;oacute;n:&lt;/span&gt;&lt;/u&gt;&lt;/em&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Es importante aclarar que las mismas condiciones anteriormente nombradas, tambi&amp;eacute;n se adjudican a las personas acompa&amp;ntilde;antes de cada equipo (&amp;ldquo;Hinchada&amp;rdquo;). En caso de que el Arbitro lo considere necesario, tambi&amp;eacute;n puede tomar la decisi&amp;oacute;n de expulsar del per&amp;iacute;metro de juego a todas aquellas personas que se encuentren &amp;ldquo;alentando&amp;rdquo; a su equipo y que no permitan el correcto desarrollo del partido. En este caso el proceder del encuentro ser&amp;aacute; de la misma forma que los puntos anteriormente citados (Punto &amp;ldquo;a&amp;rdquo; y &amp;ldquo;b&amp;rdquo; de la Regla N&amp;deg; 15 &amp;ldquo;Comportamiento del DT&amp;rdquo;).&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;16. Capitanas&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;En caso que se requiera informaci&amp;oacute;n acerca del desarrollo del juego, tiempo transcurrido, resultado u otras cuestiones, la capitana podr&amp;aacute; solicit&amp;aacute;rselo al &amp;aacute;rbitro as&amp;iacute; como tambi&amp;eacute;n cualquier tipo de queja, protesta o pedido de aclaraci&amp;oacute;n sobre el criterio tomado en la sanci&amp;oacute;n de una jugada. El &amp;aacute;rbitro no estar&amp;aacute; obligado a conversar con cualquier otra jugadora dentro del campo de juego ni fuera del mismo.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;17. Ley de Ventaja&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Queda pura y exclusivamente a criterio del &amp;aacute;rbitro, con el objetivo de no cortar una jugada de gol para cualquiera de los dos equipos.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;18. Reemplazo de jugadora por lesi&amp;oacute;n&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Una jugadora lesionada podr&amp;aacute; ser remplazada por otra en cualquier momento del torneo siempre que sea comunicado y autorizado por la organizaci&amp;oacute;n. A tal efecto, la nueva ingresante deber&amp;aacute; presentar un certificado m&amp;eacute;dico que la habilite a jugar el Torneo y la califique como apta para realizar este tipo de actividad.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;19.Comportamiento del p&amp;uacute;blico acompa&amp;ntilde;ante&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Dado el caso de que cualquier persona &amp;ldquo;acompa&amp;ntilde;ante&amp;rdquo; de un equipo se comporte de una manera inadecuada durante el transcurso del partido, podr&amp;aacute; perjudicar tanto el desarrollo del encuentro como al equipo que vino a alentar.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;En una primera instancia se le dar&amp;aacute; aviso a la capitana del equipo que una persona esta comport&amp;aacute;ndose de manera incorrecta y est&amp;aacute; afectando el correcto desarrollo del partido. De persistir esta conducta inadecuada, el Arbitro del encuentro juntar&amp;aacute; a todo el equipo para advertirlo de que si esta conducta se sigue manteniendo, se dar&amp;aacute; por suspendido el encuentro. En el caso de tener que suspender el partido por una conducta inadecuada de una persona que viene a obrservar a un equipo, el mismo saldr&amp;aacute; perjudicado seg&amp;uacute;n lo citado en el punto 15. (mismo caso que en el citado como &amp;ldquo;comportamiento del DT&amp;rdquo;) &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 20pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;20. Indumentaria&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;El equipo deber&amp;aacute; presentar camisetas o pecheras de un mismo color y se exige que las mismas est&amp;eacute;n numeradas. Se encuentra PROHIBIDO usar botines con tapones que puedan lastimar al rival y accesorios innecesarios para el juego que son riesgosos para la propia jugadora o el resto (pearcing, anteojos, relojes, pulseras, anillos, etc.). La responsabilidad de posibles accidentes asimismo como a las dem&amp;aacute;s personas por el uso de estos accesorios, recaer&amp;aacute; sobre la jugadora que no respete dicho punto.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;Parte III: SANCIONES&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;1. Tarjeta amarilla&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;Aquella jugadora que acumule dos tarjetas amarillas en el mismo encuentro recibir&amp;aacute; inmediatamente la tarjeta roja y ser&amp;aacute; expulsada. La acumulaci&amp;oacute;n de 3 (tres) tarjetas amarillas, en diferentes encuentros, se sancionar&amp;aacute; con 1 (una) fecha de suspensi&amp;oacute;n. La misma ser&amp;aacute; la inmediata siguiente a la que se recibi&amp;oacute; la tercera tarjeta amarilla. No ser&amp;aacute; necesaria la previa advertencia del &amp;aacute;rbitro a una jugadora para sacarle tarjeta amarilla.&lt;/span&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;En caso de que una jugadora llegue a su tercera tarjeta amarilla, la organizaci&amp;oacute;n avisara por medio fehaciente de dicha acumulaci&amp;oacute;n y sobre la fecha de suspensi&amp;oacute;n a cumplir por la misma.&lt;/span&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;Llegada a la instancia de play-off se borrar&amp;aacute; dicha acumulaci&amp;oacute;n. En esta instancia, la acumulaci&amp;oacute;n de 2 (dos) tarjetas amarillas ser&amp;aacute; sancionada con una fecha de suspensi&amp;oacute;n. Es decir, que al iniciar la instancia de Play Off, todas las jugadoras tendr&amp;aacute;n 0 (cero) Tarjetas Amarillas acumuladas. En el caso de que una jugadora acumule 2 (dos) Tarjetas Amarillas durante el transcurso de esta instancia, ser&amp;aacute; sancionada con una fecha de suspensi&amp;oacute;n.&lt;/span&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;En este caso, la organizaci&amp;oacute;n tambi&amp;eacute;n avisar&amp;aacute; por medio fehaciente al equipo que tenga alguna jugadora que debiera tener una fecha libre.&lt;/span&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;2. Tarjeta Azul&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Aquella jugadora que reciba una tarjeta azul, quedar&amp;aacute; autom&amp;aacute;ticamente fuera del encuentro sin recibir ninguna fecha de suspensi&amp;oacute;n.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Si bien dicha jugadora, quien recibi&amp;oacute; la tarjeta azul, no puede volver a ingresar en este partido, el arbitro avisar&amp;aacute; a la capitana del equipo en cuanto tiempo puede ingresar otra jugadora a reemplazarla. El tiempo en el que el equipo quedar&amp;aacute; obligatoriamente con una jugadora menos es de 2 minutos. A su vez el arbitro tiene la facultad de sancionar por mas tiempo al equipo pudiendo No permitir el ingreso de ninguna otra jugadora en reemplazo de la sancionada con una tarjeta azul en todo lo que resta del encuentro.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;IMPORTANTE: El &amp;aacute;rbitro del encuentro, en el momento que sanciona a una jugadora con una Tarjeta Azul, deber&amp;aacute; informar a la Capitana del equipo, cu&amp;aacute;nto tiempo tiene que transcurrir para que pueda entrar una jugadora suplente a reemplazarla.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;3. Tarjeta roja&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Puede&amp;nbsp;ser directa o indirecta (dos tarjetas amarillas en el mismo encuentro). La jugadora deber&amp;aacute; abandonar el partido y no podr&amp;aacute; permanecer en el per&amp;iacute;metro de juego. Caso contrario el encuentro ser&amp;aacute; suspendido, perjudicando a su equipo. Dependiendo de la gravedad de la infracci&amp;oacute;n, el &amp;aacute;rbitro informar&amp;aacute; a La Organizaci&amp;oacute;n, quien determinar&amp;aacute; la cantidad de fechas de suspensi&amp;oacute;n que ser&amp;aacute;n asignadas a la jugadora en cuesti&amp;oacute;n. La misma ser&amp;aacute; comunicada en el transcurso de la semana inmediata siguiente por medio fehaciente.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;em&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/em&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;em&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;IMPORTANTE:&amp;nbsp;&lt;/span&gt;&lt;/em&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Cabe aclarar que cada equipo puede, desde el principio del encuentro, disputar del mismo con un m&amp;iacute;nimo de hasta 3 jugadoras en cancha.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Si dadas las circunstancias del encuentro, uno de los dos equipos, ya sea por tarjeta azul (si es que no tiene mas reemplazos) o por tarjeta roja, llegue a 3 jugadoras expulsadas, el encuentro no seguir&amp;aacute; su curso. De este modo, el equipo que se encuentre con menos de 3 jugadoras en cancha, perder&amp;aacute; el encuentro por 5 a 0 y los goles no se computaran para ninguna jugadora del equipo rival (ganador).&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size:13.5pt;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;mso-fareast-font-family:\r\n&amp;quot;Times New Roman&amp;quot;;color:#FF3399;mso-fareast-language:ES-AR\\&quot;&gt;Si un partido se suspende porque un equipo no puede seguir jugando por terminar con inferioridad num&amp;eacute;rica (3 jugadoras expulsdas) y el mismo iba ganando, terminara perdiendo el partido por 5 a 0. En el caso de que el resultado no sea favorable para este equipo, el partido terminara con el resultado obtenido hasta el momento&lt;/span&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;. &lt;/span&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;4. Tipos de sanciones&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;Agresi&amp;oacute;n f&amp;iacute;sica a La Organizaci&amp;oacute;n:&lt;/span&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;expulsi&amp;oacute;n del torneo.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;Agresi&amp;oacute;n f&amp;iacute;sica al &amp;aacute;rbitro:&lt;/span&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;expulsi&amp;oacute;n del torneo.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;Agresi&amp;oacute;n f&amp;iacute;sica a un adversario: Leve:&lt;/span&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;de 1 fecha; Media: de 2 a 3 fechas; Brusca: 4 fechas.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;Intento de agresi&amp;oacute;n f&amp;iacute;sica / Agresi&amp;oacute;n verbal a La Organizaci&amp;oacute;n:&lt;/span&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;3 fechas&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;Intento de agresi&amp;oacute;n f&amp;iacute;sica / Agresi&amp;oacute;n verbal al &amp;aacute;rbitro:&lt;/span&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;3 fechas&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;Intento de agresi&amp;oacute;n f&amp;iacute;sica / Agresi&amp;oacute;n verbal a un adversario:&lt;/span&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;2 fechas&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;Intento de agresi&amp;oacute;n f&amp;iacute;sica / Agresi&amp;oacute;n Verbal a un compa&amp;ntilde;ero:&lt;/span&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;1 fecha&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: Arial, sans-serif;\\&quot;&gt;Juego brusco:&lt;/span&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;de 1 a 3 fechas dependiendo de la gravedad del hecho a criterio de La Organizaci&amp;oacute;n.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;Los insultos al aire, luego de una advertencia, ser&amp;aacute;n sancionados con una tarjeta amarilla con el esp&amp;iacute;ritu de mantener un clima de respeto frente al resto de las jugadoras en el campo de juego y fuera del mismo.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;MsoNormal\\&quot; align=\\&quot;center\\&quot; style=\\&quot;text-align: center; background-position: initial initial; background-repeat: initial initial;\\&quot;&gt;&lt;span style=\\&quot;font-size: 13.5pt; font-family: \\''Times New Roman\\'', serif;\\&quot;&gt;&lt;br /&gt;\r\nLas sanciones que determine la organizaci&amp;oacute;n depender&amp;aacute;n del informe de los se&amp;ntilde;ores &amp;aacute;rbitros, el veedor y de lo que observe La Organizaci&amp;oacute;n. Las sanciones que no est&amp;eacute;n en este reglamento quedan bajo la exclusiva determinaci&amp;oacute;n de La Organizaci&amp;oacute;n.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;/div&gt;');
