INSERT INTO `reglamentos` (`id`, `idTorneo`, `titulo`, `descripcion`) VALUES
(9, 4, 'De Primera Reglamento Fútbol 5', 'Parte I: ORGANIZACION\r\n 	\r\n1.	Sistemas de Pago\r\n\r\nLos equipos deberán abonar el canon correspondiente al partido de cada fecha. La Organización, por su parte, entregará su recibo correspondiente. A su vez, junto con el pago de la inscripción, cada equipo deberá abonar un depósito, equivalente al valor de un partido, el cual se devolverá al equipo una vez finalizado el Torneo en caso de no haber sido utilizado en el transcurso del mismo. \r\n\r\n2.	Inasistencia a partidos\r\n\r\nUn equipo podrá comunicar a La Organización sobre su inasistencia a un partido hasta el día miércoles hasta las 23.00hs de la misma semana en que se juegue el partido. En tal caso, dicho partido se reprogramará, dando aviso al equipo rival, en un día y horario conveniente para ambas partes. Únicamente, un equipo podrá comunicar su inasistencia y tendrá derecho a reprogramar sus partidos en 2 (dos) oportunidades. En caso de superarse dicha cantidad, La Organización no garantiza la reprogramación de esos partidos, pudiendo otorgar los puntos al equipo rival.\r\nEn caso que un equipo comunique su inasistencia pasado el día miércoles, se consultará al otro equipo acerca de la conveniencia de la reprogramación, apelando al Fair Play de los jugadores. En caso que se acuerde la reprogramación, la misma quedará sujeta a disponibilidad horaria de La Organización. El equipo consultado puede pedir los puntos del partido, por lo que se le dará por ganado el partido por 5-0, pero los goles no se le computarán a ninguno de sus jugadores. Por su parte, al equipo ausente se le descontará el depósito efectuado a inicio del Torneo.   \r\nEn caso que un equipo no asiste a su partido sin previo aviso ni comunicación, se le dará por ganado el partido al equipo rival por un total de 5-0, pero los goles no se le computarán a ninguno de sus jugadores. A su vez, se le descontará el depósito efectuado a inicio del Torneo y se le quitarán 3 (tres) puntos de la Tabla General de Posiciones de su categoría. \r\n\r\nIMPORTANTE: Los avisos de ausencia a un encuentro se deben realizar por teléfono a La Organización y mail a la dirección general de la Organización (deprimerafutbol5@hotmail.com), el cual debe ser debidamente respondido. En caso de no serlo o no recibir aviso de lectura, no se tomará el mismo como comunicación fehaciente hacia La Organización y, por tanto, se desconocerá. \r\n \r\n3.	 Retiro del torneo\r\n\r\nLa Organización podrá decidir el retiro o expulsión de  un equipo de una categoría o del Torneo directamente. A su vez, en caso de necesidad, podrá designar el cambio de categoría de un equipo, en principio, motivado por una excesiva diferencia de nivel.  \r\nEn los casos en que un equipo no continúe jugando en la categoría, se les dará a los demás equipos ese partido ganado por 5-0, sin computarse los goles a ninguno de sus jugadores. \r\nDe retirarse un equipo por voluntad propia, el mismo perderá el derecho a recuperar su depósito.\r\n\r\n\r\n\r\n\r\n4.	Planilla\r\n\r\nDe inscripción: en la misma, se deberán completar todos los datos requeridos pertenecientes a los jugadores que integrarán el equipo, pudiendo inscribir a un máximo de 12 (doce). A su vez, deberán firmar la última hoja reconociendo que se aceptan todos los puntos citados en dicha inscripción. Solo se permitirán incluir nuevos jugadores en la medida en que no se haya superado el límite citado precedentemente o bien cuando por justificada razón alguno de los mismos no continúe jugando. \r\n Aquellos equipos que no abonen la inscripción no se considerarán formalmente inscriptos, por lo que su lugar podrá ser ocupado por otro que la haya abonado. \r\n \r\nDe juego: previo a un encuentro, el equipo deberá dar el presente y completar su planilla con los datos correspondientes a cada jugador: número de camiseta, nombre y apellido. Solamente se podrán agregar jugadores a dicha planilla con previo aviso a La Organización y habiéndolos incluido en la Planilla de Inscripción. En ningún caso, se podrá exceder el máximo de 12 jugadores. \r\nSi un jugador, por motivos indefinidos, llegara tarde a un encuentro, podrá participar del partido siempre y cuando se anuncie a La Organización y firme la planilla de Juego.\r\nEs necesario firmar la planilla de juego 10 minutos antes del horario programado para el inicio del partido. Se permitirá comenzar el mismo siempre y cuando cada equipo cuente con un mínimo de 4 jugadores.\r\nFinalizado el encuentro, el capitán de cada equipo tendrá a su disposición la planilla de juego con los resultados obtenidos y los goles correspondientes a cada jugador, ya sea para certificar dicha planilla o para efectuar un reclamo correspondiente a ese partido. En caso de  realizar algún reclamo respecto del resultado o los goles atribuidos a sus jugadores, el capitán deberá elevarlo el mismo día del encuentro ante la presencia del árbitro en cuestión, de manera de aclarar el episodio y determinar los datos correctos. No se aceptarán reclamos de esa índole luego del día en que fue jugado el partido.\r\n5.	Tolerancias para el inicio de los partidos\r\n\r\nEl tiempo de tolerancia para cada uno de los encuentros es de 15 minutos. Pasado ese tiempo, si uno de los equipos llega tarde, el que haya respetado el horario, podrá reclamar el beneficio de obtener el partido como ganado sin necesidad de jugar el encuentro (este presente o no su rival). En ese caso, se le dará la victoria por 5-0 sin que los goles se atribuyan a ninguno de sus jugadores. \r\nImportante: Si el equipo decide jugar el encuentro y desea obtener el beneficio anteriormente nombrado, deberá informárselo a la organización previa al inicio del enfrentamiento. En este caso, el costo del partido deberá ser abonado por ambas partes, independientemente de que la victoria haya sido adjudicada a uno de los equipos.\r\nEn caso de que el equipo decida no jugar el encuentro, a aquél que haya llegado tarde se le descontará el depósito correspondiente.\r\nSi el rival no se presenta al encuentro, el equipo presente se hará acreedor del beneficio sin necesidad de reclamarlo ante la organización.\r\nLos partidos, en el caso de jugarse con un atraso superior a los 15 minutos, se podrán acortar en su tiempo, independientemente de que los puntos se encuentren o no en juego, con el espíritu de no demorar a los demás partidos y equipos (se dará previo aviso a los capitanes de cada equipo en caso de tomar esta medida).\r\n \r\n6.	Reclamos\r\n\r\nEn lo que se refiere a reclamos, se podrán realizar con un plazo de 7 días luego de haber acontecido el partido y deberá efectuarse en forma escrita; detrás de su planilla de juego. Pasado este tiempo, la organización podrá no hacerse responsable de los mismos. \r\nEn caso que correspondiere, La Organización responderá en forma escrita hacia el capitán del equipo, dando las debidas explicaciones del caso y responsabilizándose por lo ocurrido de ser necesario.\r\n\r\n7.	Otros acontecimientos\r\n\r\n•	La organización se reserva el derecho de modificar la programación de los partidos como así también la estructura del torneo para la correcta marcha del mismo.              \r\n•	La organización no se hace responsable de las posibles pérdidas materiales dentro o fuera del complejo.\r\n•	La organización no se hace responsable de los posibles accidentes ocasionados dentro y fuera del campo de juego. De todos hay un botiquín de primeros auxilios.\r\n•	La Organización no puede desautorizar ningún tipo de fallo arbitral durante el transcurso o luego de la finalización de un encuentro, ya sea de fase regular o Play-off. El árbitro es la máxima autoridad dentro de la cancha, por lo que ninguna persona desde fuera de la misma podrá revertir lo que determine. \r\n•	La organización se reserva el derecho de admisión tanto al torneo como al complejo.\r\n•	El Veedor del Partido\r\n•	La función del veedor será la de confeccionar la planilla del partido antes del inicio del encuentro, el registro de los jugadores con su número dorsal, capitanes y el técnico acreditado de cada equipo, firma de estos y la verificación por parte del árbitro si este lo considerará necesario. Es también función de este verificar la identidad y número dorsal de los 6 jugadores iniciales así como el resto de los jugadores.\r\n\r\n Es obligación del veedor registrar las faltas personales de los jugadores señaladas oportunamente por él árbitro a este.\r\n\r\n Se deja constancia que el veedor no puede modificar los fallos del árbitro, limita a facilitar el normal desarrollo del partido (Ej. Alcanzando las pelotas, el agua cuando fuera necesario, solicitar asistencia médica, etc) .\r\n\r\n\r\n•	El  árbitro del encuentro\r\n\r\n•	Las funciones del árbitro comienzan en el momento en que este ingresa a la cancha momento en donde comienzan su autoridad y facultades para advertir a cualquier jugador o técnico que adopten conductas inconvenientes, incluso la de descalificar según la naturaleza de la infracción cometida.\r\n\r\nLas facultades y deberes de los árbitros son aplicar las reglas y decidir sobre cualquier situación originada durante el juego en sus aspectos técnicos y disciplinarios, las cuales son finales e inapelables en cuanto se relacionen con el partido y el resultado del mismo.\r\n\r\nTodos los partidos serán dirigidos por árbitros designados por la organización los cuales tendrán la facultad de aplicar las normas del presente reglamento.\r\n\r\nLa llegada tardía del referí no será motivo suficiente para la suspensión del cotejo exceptuando que se supere el tiempo lógica de espera, en ese caso se reprogramaría el partido.\r\n \r\n•	Parte II: JUEGO\r\n \r\n1.	Duración de los partidos: el encuentro se divide en dos tiempos de 25 minutos, con un entretiempo de 5 minutos. \r\n2.	Puntos: por partido ganado se obtendrán 3 - tres - puntos, por partido empatado 1 - uno - puntos y por partido perdido 0 - cero - punto. \r\n\r\n3.	Estructura del torneo: la modalidad de juego de cada torneo quedará a criterio de La Organización en función de la necesidad, cantidad de categorías y mejor esquema de juego para los equipos.\r\n\r\n4.	 Goles: serán válidos pasando la mitad de la cancha. No están permitidos los goles directos de los saques del medio, con excepción de que la pelota se desvíe en algún jugador o el arquero antes de entrar al arco.\r\n\r\n5.	 Cambios: además de los 5 titulares se permite tener hasta 7 suplentes más. Los cambios son ilimitados, autorizados únicamente por el árbitro y en el momento en que él indique, con el espíritu de no interrumpir ninguna jugada ni avance de gol para ninguno de los dos equipos.\r\n\r\n6.	 Arquero: tanto el saque de arco como así también cualquier inicio del juego por parte del arquero, tendrá que realizarse con las manos, no pudiendo la pelota ir más allá de la mitad de la cancha, excepto que sea interceptada por cualquier jugador de campo en su trayecto y con anterioridad a que supere dicha zona. En caso que esto suceda, el equipo contrario repondrá el juego con un lateral ejecutado desde la mitad de la cancha. Únicamente el arquero podrá sacar con el pie en caso que deje picar la pelota dentro de su área. No será válido el gol convertido de forma directa por el arquero que saque del arco bajo esta modalidad. En tal caso, el equipo contrario repondrá el juego desde el medio de la cancha mediante un lateral. \r\nEl arquero NO PUEDE pasar la mitad de la cancha con o sin pelota dominada. Tampoco podrá recibir la pelota con las manos si un jugador de su propio equipo le hace un pase directo (con excepción de que el mismo sea de lateral). En caso de cometerse dicha infracción, el rival tendrá a su favor un tiro libre indirecto fuera del área, lo más próximo al lugar en donde se cometió la misma. \r\nEl arquero no puede darse juego a sí misma. En caso contrario, se cobrará lateral para el equipo contrario desde el lugar más próximo a la infracción.\r\n\r\n7.	Saques laterales: se efectúan con los pies sin permitirse envíos por el aire al área rival. La distancia que debe guardar el adversario son 3(tres) pasos (la distancia será cedida siempre y cuando el jugador lo pida).\r\n\r\n8.	 Tiros libres: serán directos e indirectos (a criterio del árbitro en función del tipo de infracción y su gravedad). En todos los casos, indicará tanto al arquero como a la ejecutante qué clase de tiro libre ha sancionado. 4 (cuatro pasos) será la distancia de la barrera, la que será cedida siempre y cuando el jugador ejecutante lo solicite. \r\n\r\n9.	 Disputa en el piso: se considera falta indirecta tirarse a los pies del rival para recuperar el balón o bien disputar el mismo. En ese caso, se sancionará tiro libre indirecto para el equipo oponente. No se considera infracción en el piso cuando no hay rival que esté disputando conjuntamente la pelota. El arquero, dentro de su propia área, podrá ir al piso siempre. Si el jugador va al piso dentro de su propia área se cobrará tiro libre indirecto fuera de la misma, en el lugar más próximo a la infracción.  La sanción de este tipo de faltas, queda exclusivamente a criterio del árbitro.\r\n\r\n10.	 Tiros de esquina: el gol es válido. Se permiten envíos al área. La distancia reglamentaria al punto de ejecución será de 3 (tres) pasos, siempre y cuando la ejecutante así lo solicite.\r\n\r\n11.	Tiros penales: se ejecutarán sin carrera, teniendo el pie de apoyo al lado del balón. En caso que exista algún tipo de rebote luego de la ejecución, el juego continuará. Todos los jugadores deberán permanecer por detrás de la línea de la pelota hasta que el penal se realice. Si así no ocurriere, el árbitro deberá hacer ejecutar nuevamente el penal. El arquero deberá permanecer con sus pies en la línea de gol. Si se adelantara, tratando de obtener ventaja de su posición para tapar el balón, el árbitro deberá hacer ejecutar nuevamente el penal. \r\n\r\n12.	 Corte del partido: en los casos en que el árbitro lo considere necesario, podrá cortar el desarrollo del partido, pudiendo ser algunas de las causas, tiempo para refresco de jugadores en caso de excesivo calor, lesión de una jugador a pesar que el juego continúe, etc. Esta medida queda determinada a entero criterio del árbitro. \r\n\r\n13.	Ley de Ventaja: a criterio del árbitro.\r\n\r\n14.	 Reemplazo de jugador por lesión: un jugador lesionado podrá ser remplazado por otro en cualquier momento del torneo siempre que sea comunicado y autorizado por la organización. A tal efecto, el nuevo ingresante deberá presentar un certificado médico que la habilite a jugar el Torneo y la califique como apta para realizar este tipo de actividad.\r\n\r\n15.	 Indumentaria: el equipo deberá presentar camisetas o pecheras de un mismo color y  se exige que las mismas estén numeradas. Se encuentra PROHIBIDO usar botines con tapones que puedan lastimar al rival y accesorios innecesarios para el juego que son riesgosos para el propio jugador o el resto (pearcing, relojes, pulseras, anillos, etc). La responsabilidad de posibles accidentes asimismo como a las demás personas por el uso de  estos accesorios, recaerá sobre el jugador que no respete dicho punto.\r\n\r\n\r\n \r\nParte III: SANCIONES\r\n\r\n \r\n1.	Tarjeta amarilla: aquel jugador que acumule dos tarjetas amarillas en el mismo encuentro recibirá inmediatamente la tarjeta roja y será expulsado. La acumulación de 4 (cuatro) tarjetas amarillas, en diferentes encuentros, se sancionará con 1 (una) fecha de suspensión. La misma será la inmediata siguiente a la que se recibió la tercera tarjeta amarilla.\r\n\r\n2.	Tarjeta azul: aquel jugador que reciba una tarjeta azul, quedará automáticamente fuera del encuentro por 5 minutos. La aplicación de esta tarjeta a un jugador no requiere que la misma haya visto la tarjeta amarilla previamente. \r\n\r\n3.	Tarjeta roja: puede ser directa o indirecta (dos tarjetas amarillas en el mismo encuentro). El jugador deberá abandonar el partido y no podrá permanecer en el perímetro de juego. Caso contrario el encuentro será suspendido, perjudicando a su equipo. Dependiendo de la gravedad de la infracción, el árbitro y La Organización determinarán la cantidad de fechas de suspensión que serán asignadas al jugador en cuestión y será comunicada en el transcurso de la semana inmediata siguiente por medio fehaciente.\r\n\r\n4.	Tipos de sanciones:\r\n \r\na.	Agresión física a La Organización: expulsión del torneo.\r\nb.	Agresión física al árbitro: expulsión del torneo.\r\nc.	Agresión física a un adversario: Leve: de 1 fecha; Media: de 2 a 3 fechas; Brusca: 4 fechas.\r\nd.	Intento de agresión física / Agresión verbal a La Organización: 3 fechas\r\ne.	Intento de agresión física / Agresión verbal al árbitro:3 fechas\r\nf.	Intento de agresión física / Agresión verbal a un adversario: 2 fechas\r\ng.	Juego brusco: de 1 a 3 fechas dependiendo de la gravedad del hecho a criterio de La Organización.\r\n \r\n \r\nLas sanciones que determine la organización dependerán del informe de los señores árbitros, el veedor y de lo que observe La Organización. Las sanciones que no estén en este reglamento quedan bajo la exclusiva determinación de La Organización');
